INSERT INTO `ps_a_blog_post_lang` (`id_post`, `id_shop`, `id_lang`, `link_rewrite`, `title`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `date_upd`)
VALUES
	(1,1,1,'','Флорист - профессия или призвание?','Флорист - профессия или призвание?','Пару лет назад мне предлагали должность флориста, но я отказалась со словами: “Цветы - это не мое! Где я и где букеты.','','<h4>Кто-то с детства мечтает стать врачом, кто-то космонавтом, а как люди попадают во флористику?</h4>\r\n<p>Не знаю про всех людей, но я явно случайно. Иногда мне вспоминается история, как пару лет назад мне предлагали должность флориста, но я отказалась со словами: &ldquo;Цветы - это не мое! Где я и где букеты. Составлять букеты...у меня для этого не хватит фантазии.&rdquo; Но теперь я с уверенностью могу сказать, что да, моё!</p>\r\n<h4>Где у нас обучают этому мастерству?</h4>\r\n<p>Есть курсы, мастер классы, ворк шопы и индивидуальное обучение, но в наш век географических ограничений нет. Я подписана на курсы и онлайн школы в России, Украине, Лондоне, Германии и даже Нью-Йорке. На мой взгляд, у такого обучения есть несколько неоспоримых плюсов. Например, обучение не заканчивается никогда, ты всё время получаешь какую-то новую информацию, в любое время можешь ею воспользоваться, даже лежа на шезлонге где-нибудь на пляже)</p>\r\n<h4>Как ты придумываешь букеты?</h4>\r\n<p>Очень по-разному. Поток &ldquo;придумывания&rdquo; не останавливается. Сейчас я подписана на такое количество каналов, страниц и флористов во всевозможных сетях, что потеряла счет. Когда окружающие думают, что я просто &ldquo;залипла&rdquo; в инстаграме, то это не обязательно так. После такого просмотра у меня скапливается куча закладок и скриншотов.</p>\r\n<p>Еще бывает, что общаешься с человеком, и вдруг в голове рождается образ букета, который ты бы ему подарил.</p>\r\n<p>Но самое интересное бывает, когда мне это снится. Главное на утро ничего не забыть.</p>\r\n<h4>Как ты считаешь, любой человек может стать флористом?</h4>\r\n<p>Каждый человек может стать продавцом цветов, но будет ли этот каждый хорошим флористом? Для меня флористика нечто более тонкое. Цветы, это в первую очередь жест любви, нежности и тепла. Флористу нужно любить свое дело, чтобы его работа доставляла кому-то счастье.</p>\r\n<h4>Кажется, что это так здорово работать с цветами! А есть ли минусы у этой профессии?</h4>\r\n<p>Да, это важный вопрос. Во-первых это физически сложная работа. Ты работаешь руками и на ногах. Во-вторых, это достаточно грязная работа ( маникюр для меня долгое время была больная тема))) Ну, и не стоит забывать, что у флориста нет выходных, нет праздников, особенно 8 марта. А ещё, нам не дарят цветы. Все почему-то решили, что нам цветы и на работе надоедают. Это не так! Дарите флористам цветы!</p>\r\n<h4>Какие цели ты ставишь себе на ближайшие 5 лет?</h4>\r\n<p>Мечтаю пройти несколько очных курсов у моих вдохновителей, за которыми слежу онлайн. В планах еще студия и школа. Они уже имеют свой вид до мельчайших деталей у меня в голове. А также, очень хочется сократить путь цветов от голландской грядки до нашего холодильника на несколько шажков.</p>','2018-11-26 14:12:59'),
	(1,1,2,'florar-o-profesie-sau-o-vocaie','Florar - o profesie sau o vocație?','Florar - o profesie sau o vocație?','Cineva din copilărie visează să devină un doctor sau un cosmonaut, dar cum nimeresc oamenii în domeniul floristic?','','<h4>Cineva din copilărie visează să devină un doctor sau un cosmonaut, dar cum nimeresc oamenii &icirc;n domeniul floristic?</h4>\r\n<p><br />Nu știu despre alții, dar eu precis am nimerit din &icirc;nt&acirc;mplare. Uneori &icirc;mi amintesc cum vreo 2 ani &icirc;n urmă mi s-a propus să devin florar. Atunci am respins propunerea, zic&acirc;nd că nu este ceva pe adevărat \"al meu.\" Credeam că n-o să-mi ajungă imaginație. Acum &icirc;nsă pot zice cu siguranță că este ceva \"al meu!\"</p>\r\n<h4><br />Unde poți &icirc;nvăța arta de a fi un florar?</h4>\r\n<p><br />Există cursuri, master-clase, work-shop-uri și instruirea individuală, dar astăzi nu mai există restricții geografice. Urmăresc cursuri on-line din Rusia, Ucraina, Germania, Marea Britanie și chiar SUA. Cred că este foarte comod și procesul de instrure este non-stop, deoarece &icirc;n fiecare zi poți primi o informație nouă. O poți folosi chiar &icirc;n timpul odihnei la mare!</p>\r\n<h4><br />Cum &icirc;ți vin idei pentru buchete?</h4>\r\n<p><br />Foarte diferit. Fluxul de \"venire a ideilor\" nu se oprește. Acum urmăresc o mulțime de pagini și florariști &icirc;n toate tipurile de rețele. C&acirc;nd alții cred că m-am pierdut pe paginile din rețea Instagram - de fapt investighez tendințe noi &icirc;n floristică, culeg idei proaspete pentru buchete.<br />Se &icirc;nt&acirc;mplă că &icirc;n moment ce comunic cu o persoană și brusc &icirc;mi vine ideea cum ar trebui să fie chipul buchetului pentru persoana acesta.<br />Cel mai interesant este c&acirc;nd idei &icirc;mi vin atunci c&acirc;nd visez.</p>\r\n<h4><br />Cum crezi, oricine poate deveni un florar?</h4>\r\n<p><br />Oricine poate deveni un v&acirc;nzător de flori, dar &icirc;l va face oare să fie un florar bun? Pentru mine floristica este ceva mai subtil. Florile, &icirc;n primul r&acirc;nd, sunt un gest de dragoste, sensibilitate și căldură. Un florar trebuie să-și iubească meseria, astfel &icirc;nc&acirc;t lucrarea lui să aducă cuiva fericire</p>\r\n<h4>Se pare că este grozav să lucrezi cu flori! Există și neplăceri &icirc;n cadrul acestei profesii sau nu?</h4>\r\n<p>Da, este o &icirc;ntrebare importantă. &Icirc;n primul r&acirc;nd, este o muncă fizică dificișă. Lucrezi cu m&acirc;inile și cu picioarele. &Icirc;n al doilea r&acirc;nd, este o muncă destul de murdară (manichiura pentru mult timp a fost un subiect dureros pentru mine))) Ei bine, și să nu uitați că florarul nu are zile libere, pentru un florar nu există sărbători, mai ales de 8 martie. Și totuși, nu ni se dăruiesc flori. Toți au decis din anumite motive că suntem plictisiți de flori de la locul nostru de muncă. Nu este drept! Dăruiți-ne flori!</p>\r\n<h4><br />Ce scopuri dorești să atingi &icirc;n următorii 5 ani?</h4>\r\n<p><br />Visez să trec prin mai multe cursuri full-time cu inspiratorii mei, pe care &icirc;i urmăresc online. &Icirc;n planuri mi-am pus sa deschid un studiou și o școală. Au deja aspectul lor p&acirc;nă la cele mai mici detalii &icirc;n imaginația mea. Și, de asemenea, chiar aș dori să scurtez calea florilor din grădina olandeză p&acirc;nă la frigiderul nostru pentru c&acirc;țiva pași.</p>','2018-11-26 14:12:59'),
	(1,1,3,'florist-professiya-ili-prizvanie','Флорист - профессия или призвание?','Флорист - профессия или призвание?','Пару лет назад мне предлагали должность флориста, но я отказалась со словами: “Цветы - это не мое! Где я и где букеты.','','<h4>Кто-то с детства мечтает стать врачом, кто-то космонавтом, а как люди попадают во флористику?</h4>\r\n<p>Не знаю про всех людей, но я явно случайно. Иногда мне вспоминается история, как пару лет назад мне предлагали должность флориста, но я отказалась со словами: &ldquo;Цветы - это не мое! Где я и где букеты. Составлять букеты...у меня для этого не хватит фантазии.&rdquo; Но теперь я с уверенностью могу сказать, что да, моё!</p>\r\n<h4>Где у нас обучают этому мастерству?</h4>\r\n<p>Есть курсы, мастер классы, ворк шопы и индивидуальное обучение, но в наш век географических ограничений нет. Я подписана на курсы и онлайн школы в России, Украине, Лондоне, Германии и даже Нью-Йорке. На мой взгляд, у такого обучения есть несколько неоспоримых плюсов. Например, обучение не заканчивается никогда, ты всё время получаешь какую-то новую информацию, в любое время можешь ею воспользоваться, даже лежа на шезлонге где-нибудь на пляже)</p>\r\n<h4>Как ты придумываешь букеты?</h4>\r\n<p>Очень по-разному. Поток &ldquo;придумывания&rdquo; не останавливается. Сейчас я подписана на такое количество каналов, страниц и флористов во всевозможных сетях, что потеряла счет. Когда окружающие думают, что я просто &ldquo;залипла&rdquo; в инстаграме, то это не обязательно так. После такого просмотра у меня скапливается куча закладок и скриншотов.</p>\r\n<p>Еще бывает, что общаешься с человеком, и вдруг в голове рождается образ букета, который ты бы ему подарил.</p>\r\n<p>Но самое интересное бывает, когда мне это снится. Главное на утро ничего не забыть.</p>\r\n<h4>Как ты считаешь, любой человек может стать флористом?</h4>\r\n<p>Каждый человек может стать продавцом цветов, но будет ли этот каждый хорошим флористом? Для меня флористика нечто более тонкое. Цветы, это в первую очередь жест любви, нежности и тепла. Флористу нужно любить свое дело, чтобы его работа доставляла кому-то счастье.</p>\r\n<h4>Кажется, что это так здорово работать с цветами! А есть ли минусы у этой профессии?</h4>\r\n<p>Да, это важный вопрос. Во-первых это физически сложная работа. Ты работаешь руками и на ногах. Во-вторых, это достаточно грязная работа ( маникюр для меня долгое время была больная тема))) Ну, и не стоит забывать, что у флориста нет выходных, нет праздников, особенно 8 марта. А ещё, нам не дарят цветы. Все почему-то решили, что нам цветы и на работе надоедают. Это не так! Дарите флористам цветы!</p>\r\n<h4>Какие цели ты ставишь себе на ближайшие 5 лет?</h4>\r\n<p>Мечтаю пройти несколько очных курсов у моих вдохновителей, за которыми слежу онлайн. В планах еще студия и школа. Они уже имеют свой вид до мельчайших деталей у меня в голове. А также, очень хочется сократить путь цветов от голландской грядки до нашего холодильника на несколько шажков.</p>','2018-11-26 14:12:59'),
	(2,1,1,'5-lifehacks-how-to-make-your-fresh-cut-flowers-last-longer','5 Lifehacks How To Make Your Fresh Cut Flowers Last Longer','5 Lifehacks How To Make Your Fresh Cut Flowers Last Longer','To make your fresh cut flowers last longer try follow our 5 simple lifehacks.','','<p>We all want the bouquet to stand as long as possible! Fresh flowers will delight you for a long time. We use the freshest flowers in our online store of gifts and flowers so that your bouquet will bring you pleasure as long as possible. Despite this, we want to offer you a few recommendations for the care, because even the freshest flowers can quickly wilt if they fall into the wrong conditions.</p>\r\n<p>1. Before placing flowers in water, remove all leaves and thorns from the stem to a level that will sink into the water. Then the flowers should be cut with a sharp knife or shears at a 45 degree angle.</p>\r\n<p>! It is necessary to cut the flowers every time, even if you just brought them from the store, or just change the water.</p>\r\n<p>2. Update the cut every day. Over time, the cut is tightened with a membrane, which prevents water absorption.</p>\r\n<p>3. Change the water every day. Pre-wash the vase, preferably with a sponge or brush, because on the walls of the vase can accumulate rot, that makes flowers wither faster.</p>\r\n<p>4. When you bring a bouquet at home, let them get used to the temperature and microclimate of the room. For example, if you brought flowers from the cold, leave them for 10-20 minutes on the balcony before unpacking and bringing into the room.</p>\r\n<p>5. Do not place a vase with flowers near heat sources or on direct sunlight.</p>\r\n<p>The Cadouri MD team wishes you the most beautiful bouquets!</p>','2018-11-26 13:41:59'),
	(2,1,2,'5-lifehacks-despre-ingrijirea-florilor-in-buchet','5 Lifehacks Despre Îngrijirea Florilor În Buchet','5 Lifehacks Despre Îngrijirea Florilor În Buchet','Pentru ca florile în buchet să stea cât mai mult și să-și păstreze aspectul proaspăt, încercați recomandările noastre.','','<p>Vrem cu toții ca buchetul cumpărat sau primit &icirc;n dar de la un prieten apropiat să stea c&acirc;t mai mult este posibil! Florile vă vor bucura mult timp dacă sunt proaspete. &Icirc;n magazinul nostru online de cadouri și flori Cadouri MD folosim doar cele mai proaspete flori. &Icirc;n acest articol vrem să vă oferim c&acirc;teva recomandări pentru &icirc;ngrijire a florilor, deoarece chiar și cele mai proaspete flori se pot ofeli repede, dacă se păstrează &icirc;n condiții greșite.</p>\r\n<p>1. &Icirc;nainte de a pune flori &icirc;n apă, &icirc;ndepărtați toate frunzele și spinii din tulpină p&acirc;nă la nivelul care va fi scufundat &icirc;n apă. Apoi florile trebuie să fie tăiate cu un cuțit ascuțit sau un pruner la un unghi de 45 de grade.</p>\r\n<p>! Tăiați florile de fiecare dată, chiar dacă tocmai le-ați adus din magazin sau pur și simplu schimbați apa.</p>\r\n<p>2. Re&icirc;nnoiți tăitura &icirc;n fiecare zi. Cu timpul, tăietura se va acoperi cu o peliculă, ceea ce va &icirc;mpiedica absorbției a apei.</p>\r\n<p>3. Trebuie să schimbați apa &icirc;n fiecare zi. Vasul &icirc;n care au stat florile trebuie să fie spălat cu o buretă, deoarece pe suprafața lui se acumulează putrezi (ceea ce face ca florile să olelească mai repede.)</p>\r\n<p>4. C&acirc;nd aduceți buchetul acasă, trebuie să se acomodeze cu temperatura și microclima camerei. Spre exemplu, dacă ați adus florile de la frig, lăsați buchetul să stea un timp &icirc;n coridor sau la balcon, 10-20 de minute va fi de ajuns.</p>\r\n<p>5. Nu lăsați ca florile să stea l&acirc;ngă surse de căldură sau la razele directe a soarelui.</p>\r\n<p>Echipa site-ului Cadouri MD vă urează să primiți &icirc;n dar doar cele mai frumoase buchete!</p>','2018-11-26 13:41:59'),
	(2,1,3,'5-lajfkhakov-po-ukhodu-za-cvetami','5 лайфхаков по уходу за цветами','5 лайфхаков по уходу за цветами','Чтобы цветы в букете, которые вам подарили, стояли долго, воспользуйтесь данными советами. Рекомендации по уходу, чтобы цветы долго радовали получателя.','','<p>Всем нам хочется, чтобы купленный или подаренный близким человеком букет простоял как можно дольше! Цветы долго будут радовать вас, если окажутся свежими. В нашем интернет-магазине подарков и цветов мы используем только самые свежие цветы, чтобы ваш букет как можно дольше приносил вам удовольствие. Несмотря на это, мы хотим предложить вам несколько рекомендаций по уходу, ведь даже самые свежие цветы могут быстро завянуть, если попадут в неправильные условия.</p>\r\n<p>1. Перед тем, как поставить цветы в воду, следует удалить все листья и шипы со стебля до уровня, который будет погружаться в воду. Затем цветы нужно подрезать острым ножом или секатором под углом 45 градусов.</p>\r\n<p>! Подрезать цветы нужно обязательно каждый раз, даже если вы только принесли их из магазина, либо просто меняете воду.</p>\r\n<p>2. Обновлять срез нужно каждый день. Со временем срез затягивается пленкой, что препятствует поглощению воды.</p>\r\n<p>3. Менять воду следует каждый день. Вазу предварительно мыть, желательно с помощью губки или щетки, так как на стенках вазы может скапливаться гниль, от которой цветы вянут быстрее.</p>\r\n<p>4. Когда приносите букет или цветы домой, дайте им привыкнуть к температуре и микроклимату помещения. Например, если вы принесли цветы с холода, то оставьте их на 10-20 минут в коридоре или же на балконе и только после распаковывайте и вносите в комнату.</p>\r\n<p>5. Не ставьте вазу с цветами у источников тепла или под прямыми лучами солнца.</p>\r\n<p><br />Команда сайта Cadouri MD желает вам самых красивых букетов!</p>\r\n<p>&nbsp;</p>','2018-11-26 13:41:59'),
	(3,1,1,'astrology-gift-giving-what-to-give-to-a-virgo','Astrology Gift Giving: What to give to a Virgo?','Astrology Gift Giving: What to give to a Virgo?','How to choose a perfect gift for a Virgo? What flowers are suitable by Astrology? View more...','','<h3>Virgo (24 august - 23 september)</h3>\r\n<p>Despite the fact that the name of this zodiac reminds us of femininity and sensitivity, Virgo women and girls are very intense and powerful personalities who know their goals and always reach them. Such people pass through life, overcoming all the difficulties. However, they are romantics and love occupies a dominant position in their lives.</p>\r\n<p>&nbsp;</p>\r\n<h4>What Flowers Do Virgo Prefer?</h4>\r\n<ul>\r\n<li>Virgo will appreciate your bouquet in any case. She also prefers wild flowers and classic roses. Exotic flowers does not scare them. The main idea is that the bouquet should create the right mood and match the occasion.</li>\r\n<li>If you want to surprise Virgo, you should pay attention to the following recommendations:<br />Flowers must be fresh and have an elegant look. Virgo are attentive to the details. You should refuse to artificial decorations.</li>\r\n<li>Choose the flowers in a pasteled, gentle range. Give preference to a blue or pale pink, as well as avalanche color and other pastel colors.</li>\r\n<li>Virgo girls are very practical. Choosing flowers give your attention to simple and elegant flowers. For example, it might be a small mixed bouquet or flowers in the box. Too rich and complicated bouquets can cause associations with vulgarity. If you want to create a perfect bouquet for Virgo, perfect fit will be flowers, such as: garden rose, lilies, peonies, bat, carnations, alstroemeria, eustoma, chrysanthemums.</li>\r\n<li>Virgo girls also love the room plants, because the element of the Virgo sign is the earth. A green and blooming plant will become a perfect gift.</li>\r\n<li>If you bend what flowers will fit perfectly to make a beautiful present to the Virgin - use the \"Custom Bouquet Design\" option from our florist with the \"Bouquet for Virgo\" comment. All recommendations will be considered!</li>\r\n</ul>\r\n<p><br />Be careful because Virgo considers a bouquet of flowers as a sign of attention, and not as a complete gift, therefore ...</p>\r\n<h4>What to give as a present to a Virgo?</h4>\r\n<p>A perfect gift for a Virgo will become something beautiful, for example:</p>\r\n<ul>\r\n<li>A book about self-development, inspiration and motivation</li>\r\n<li>An elegant and beautiful notepad or sketchbook</li>\r\n<li>A SPA gift set, decorated with flowers</li>\r\n</ul>','2018-11-26 13:27:26'),
	(3,1,2,'flori-i-cadouri-pentru-fecioare-cum-sa-alegi-cadouri-pentru-cei-nascui-in-septembrie','Flori și cadouri pentru Fecioare. Cum să alegi cadouri pentru cei născuți în septembrie?','Flori și cadouri pentru Fecioare. Cum să alegi cadouri pentru cei născuți în Septembrie?','Cum să alegi cadouri pentu Fecioara? Cum să alegi florile potrivite zodiei? Vezi mai mult...','','<h3>Fecioara (24 august - 23 septembrie)</h3>\r\n<p><br />&Icirc;n ciuda faptului că numele acestui zodiac ne reamintește despre feminitatea și sensibilitatea, femeile și fetele Fecioare sunt personalități foarte intense și puternice, care &icirc;și cunosc obiectivele și care le vor atinge. Astfel de oameni trec cu &icirc;ndrăzneală prin viață, depășind toate dificultățile. Cu toate acestea, sunt romantici și dragostea &icirc;n viața lor ocupă o poziție dominantă.</p>\r\n<h4><br />Ce flori preferă Feciorele?</h4>\r\n<p><br />Fecioara va aprecia buchetul Dvs. &icirc;n orice caz. Preferă și flori sălbatice și trandafiri clasici. Exotica, de asemenea, nu le sperie. Ideea principală este că buchetul trebuie să creeze dispoziția potrivită și să corespundă ocaziei.<br />Dacă doriți să o surprindeți pe Fecioara, atrageți atenția la următoarele recomandări:</p>\r\n<ol>\r\n<li>Florile trebuie să fie proaspete și să aibă un aspect elegant. Fecioarele sunt atente la detalii. Ar trebui să refuzați la decor artificial.</li>\r\n<li>Alegeți florile &icirc;ntr-o gamă pastelată, gingașă. Dați preferința unui albastru sau roz deschis, deasemenea se va potrivi culoarea avalanche și alte culori pastelate.</li>\r\n<li>Fetele Fecioare sunt foarte practice. Aleg&acirc;nd florile acoradați atenția florilor simple și elegante. De exemplu, ar putea fi un mic buchet mixt sau flori &icirc;ntr-o cutie pentru pălărie. Buchetele prea bogate și complicate pot provoca asociații cu vulgaritate. Pentru a crea un buchet perfect pentru Fecioare, se potrivesc florile, cum ar fi: trandafir de grădina, crini, bujori, liliac, garoafe, alstroemeria, eustoma, crizanteme.</li>\r\n<li>Fecioarele ador florile de cameră, deoarece elementul zodiei Fecioara este păm&acirc;ntul. Fecioara va aminti cu plăcere și căldura sufletească despre un asemenea cadou. O plantă verde și &icirc;nflorită va deveni un cadou perfect.</li>\r\n<li>Dacă vă &icirc;ndoiți ce flori se vor potrivi perfect pentru a face un cadou frumos Fecioarei - utilizați funcția \"Buchetul Personalizat\" de la florarul nostru, cu comentariul \"Buchet pentru Fecioară\". Toate recomandările vor fi luate &icirc;n considerare!</li>\r\n</ol>\r\n<p>&nbsp;Fiți atenți, deoarece Feciorele consideră ca un buchet de flori este doar un semn de atenție, și nu un cadou complet, deaceea...</p>\r\n<h4><br />Ce să dăruiești Feciorei?</h4>\r\n<p><br />Un cadou perfect pentru o Fecioră va deveni ceva frumos și util, spre exemplu:</p>\r\n<ol>\r\n<li>O carte despre autodezvoltare, inspirație și motivație</li>\r\n<li>O agendă sau un caiet pentru notițe elegant și frumos</li>\r\n<li>Un set-cadou SPA, decorat cu flori</li>\r\n</ol>','2018-11-26 13:27:26'),
	(3,1,3,'kakie-cvety-darit-devam','Какие цветы лучше дарить Девам?','Какие цветы дарить Девам?','How to choose a perfect gift for a Virgo? What flowers are suitable by Astrology? View more...','','<h3>Дева (24 августа - 23 сентября)</h3>\r\n<p>Несмотря на то, что название этого знака напоминает о женственности, нежности и и покорности, на самом деле женщины и девушки Девы - очень целеустремленные и сильные личности, знающие свои цели и идущие к их достижению. Такие люди четко знают, чего они хотят и как этого добиться, поэтому смело идут по жизни, преодолевая все трудности. Тем не менее они все еще романтичны и любовь в их жизни занимает главенствующее место.</p>\r\n<h4>Какие цветы подарить Девам?</h4>\r\n<p>Девы оценят Ваш букет в любом случае. Им придутся по душе и полевые цветы, и классические розы. Экзотика так же не напугает их. Главное, чтобы букет создавал правильное настроение и соответствовал поводу.</p>\r\n<p>Если вы хотите удивить Деву цветами, обратите внимание на следующие рекомендации:</p>\r\n<ul>\r\n<li>Цветы должны быть свежими и иметь опрятный вид. Девы всегда подмечают такие детали. Также стоит отказаться от искусственного декора.</li>\r\n<li>Отдайте предпочтение цветам в пастельной, нежной гамме цветов. Это может быть нежно розовый, нежно голубой, аваланж, кремовый и другие нежные цвета.</li>\r\n<li>Девушки Девы очень практичные. Выбирая цветы стоит обратить внимание на что-то простое и стильное. Например это может быть небольшой смешанный букет или <a title=\"Цветы в Шляпных Коробках - Cadouri MD\" href=\"https://cadouri.md/ru/22-cvety-v-shlyapnykh-korobkakh\" target=\"_blank\" rel=\"noopener\">цветы в шляпной коробке</a>. Помпезные и сложные букеты могут вызвать у Девы ассоциации с грубостью и вульгарностью. Подойдут для создания идеального букета для Дев такие цветы, как: садовая роза, лилии, пионы, сирень, розовые гвоздики, альстромерии, эустомы, хризантемы.</li>\r\n<li>Девы просто обожают <a title=\"Комнатные Цветы - Cadouri MD\" href=\"https://cadouri.md/ru/13-komnatnye-rasteniya\" target=\"_blank\" rel=\"noopener\">комнатные растения</a>, ведь стихия Дев - Земля. Еще долго Дева будет с нежностью и теплотой в душе вспоминать ваш искренний жест, если вы подарите ей зеленое цветущее растение в горшке.</li>\r\n<li>Если вы сомневаетесь, какие цветы подойдут Деве и сделают ваш подарок неповторимым - воспользуйтесь функцией <a title=\"авторский Букет - Cadouri MD\" href=\"https://cadouri.md/ru/cvety/109-3-custom-florist-design.html#/2-size-m\" target=\"_blank\" rel=\"noopener\">Авторский Букет</a> от нашего флориста, с комментарием &ldquo;Букет для Девы&rdquo;. Тогда все рекомендации будут учтены!</li>\r\n</ul>\r\n<p>Будьте осторожны, ведь Дева не рассматривает букет цветов как самостоятельный подарок, только как небольшой знак внимания, поэтому...</p>\r\n<h4>Что подарить Деве?</h4>\r\n<p>Идеальным подарком для Девы станет что-то красивое и практичное, например:</p>\r\n<ul>\r\n<li>Книга о саморазвитии, вдохновении и мотивации</li>\r\n<li>Элегантный ежедневник или блокнот для записей</li>\r\n<li>Подарочный <a title=\"SPA Наборы для ванны - Cadouri.md\" href=\"https://cadouri.md/ru/18-spa-boxes\" target=\"_blank\" rel=\"noopener\">SPA набор для ванны</a>, оформленный цветами</li>\r\n<li>Сладкий <a title=\"Сладкие Съедобные Наборы - Cadouri MD\" href=\"https://cadouri.md/ru/17-sweet-boxes\" target=\"_blank\" rel=\"noopener\">медовый набор с орехами и сухофруктами</a> для укрепления иммунитета</li>\r\n</ul>','2018-11-26 13:27:26'),
