	(6,1,1,'astrology-gift-giving-what-to-give-to-a-scorpio','Astrology Gift Giving: What to give to a Scorpio?','Astrology Gift Giving: What to give to a Scorpio?','How to choose a perfect gift for a Scorpio? What flowers are suitable by Astrology? View more...','','<h3>Scorpio (24 october - 22 november)</h3>\r\n<p>Girls Scorpions are very capricious. For them it is important not just your attention, but also the gift itself, and they are not afraid to admit this to themselves. Girls Scorpions are able to show attention with their gifts, and they expect this from others as well.</p>\r\n<p><br />Women Scorpions do not perceive flowers as a full-fledged gift. This is a great sign of attention, worthy of joy and pleasant memories, but no more. The thing is that Scorpions love individual approach.</p>\r\n<p>&nbsp;</p>\r\n<h4><br />If you want to choose flowers for a girl Scorpio:</h4>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Be sure to find out what are her favorite flowers, it&rsquo;s important if you show extra attention to Scorpions and show that you remember her preferences.</li>\r\n<li>Look at simple and concise bouquets without additional decoration, regardless of whether the field flowers or elegant roses.</li>\r\n<li>Do not forget that only a bouquet of fresh flowers makes a good impression, because they will stay longer and look neater.</li>\r\n<li>Look for bouquets and flower arrangements of peonies, garden roses, pink carnations or eustome. Despite its controversial character, the girls of Scorpio are delighted with delicate flowers.</li>\r\n</ul>\r\n<p><br />If you choose a gift for a woman Scorpio, be creative, think of her innermost dreams. Scorpios love gifts that are made specifically for them, which means they have something hinting at their identity. However, we do not always have the opportunity to think for too long.</p>\r\n<p>&nbsp;</p>\r\n<h4>A perfect gift can be:</h4>\r\n<ul>\r\n<li>A diary or an interesting notebook with a set for creativity</li>\r\n<li>Gift box with a variety of sweets</li>\r\n<li>Big set with personal care products</li>\r\n<li>Wine set for a romantic evening for two, if you happen to be in a relationship with a girl Scorpio</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>You can at contact us with a question about gifts or flowers and we will select something unusual for your particular occasion.</p>\r\n<p>&nbsp;</p>','2018-11-26 14:36:53'),
	(6,1,2,'flori-i-cadouri-pentru-scorpion-cum-sa-alegi-cadouri-pentru-cei-nascui-in-noiembrie','Flori și cadouri pentru Scorpion. Cum să alegi cadouri pentru cei născuți în Noiembrie?','Flori și cadouri pentru Scorpion. Cum să alegi cadouri pentru cei născuți în Noiembrie?','Cum să alegi cadouri pentu Scorpion? Cum să alegi florile potrivite zodiei? Vezi mai mult...','','<h3>Scorpion (24 octombrie - 22 noiembrie)</h3>\r\n<p>Fetele Scorpioni sunt persoane cu un caracter foarte puternic. Le este importantă nu doar atenția din partea Dvs., dar și cadoul primit. Domnișoarele Scorpioni știu cum să facă cadouri personalizate și așteaptă că veți fi la fel de atenți la detalii pentru ele.</p>\r\n<p><br />Femeile Scorpioni nu cred că florile pot fi ceva mai mult, dec&acirc;t un semn de atenție, chiar dacă este frumos, proaspăt și va aduce emoții pozitive. Deaceea &icirc;n ad&acirc;ncimea sufletului mereu așteaptă ceva &icirc;n plus (c&acirc;t de micuț n-ar fi cadou.) Fetele Scorpioni vă vor mulțumi pentru un cadou personalizat.</p>\r\n<h4><br />Dacă vreți să alegeți florile pentru o femeie Scorpion:</h4>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Aflați neapărat ce fel de flori preferă mai mult. Pentru domnișoarele Scorpioni este foarte important că le țineți minte preferințele.</li>\r\n<li>Atrageți atenția la buchete mai simple, fără decor exagerat, indiferent dacă sunt flori de grădină sau trandafiri elegante.</li>\r\n<li>Nu uitați că impresia cea mai bună fac flori proaspete, deoarece vor sta &icirc;n apă mai mult timp și au un aspect mai curat și &icirc;ngrijit.</li>\r\n<li>Alegeți dintre compoziții floristice cu trandafiri de grădină, bujori, garoafe roz sau eustome. &Icirc;n ciuda faptului că Scorpionii au un caracter complicat, preferă flori palide la culoare și gingașe.</li>\r\n</ul>\r\n<p><br />Dacă sunteți &icirc;n căutare de cadou pentru femeie Scorpion, &icirc;ncercați să fiți creativi. Amintiți la ce visează femeia Scorpion. Un cadou făcut de m&acirc;ni și personalizat, un cadou la care demult visau sau despre care au povestit mult, ceva legat cu copilăria lor sau cu emoții pozitive puternice - se va potrivi orice din lista propusă. Dar, uneori nu avem prea mult timp pentru a căuta ceva special.</p>\r\n<p>&nbsp;</p>\r\n<h4>Un cadou perfect va deveni:</h4>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Set pentru creație cu un sketchbook sau carnet</li>\r\n<li>Gift Box cu un set mare de dulciuri</li>\r\n<li>Un set mare SPA cu diferite produse pentru &icirc;ngrijirea pielii</li>\r\n<li>Un Gift Box cu vin pentru doi (&Icirc;n caz dacă aveți fericirea să fiți &icirc;n relații cu Scorpion)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&Icirc;n orice caz puteți apela la ajutorul nostru &icirc;n alegerea cadourilor. Cu noi a deveni mai simplu să fii creativ &icirc;n alegerea cadourilor!</p>\r\n<p>&nbsp;</p>','2018-11-26 14:36:53'),
	(6,1,3,'kakie-cvety-darit-skorpionam-floristicheskij-prognoz','Какие цветы дарить Скорпионам? Флористический прогноз.','Какие цветы дарить Скорпионам? Флористический прогноз.','Как подобрать подарок девушке Скорпиону? Как выбрать цветы, которые подходят по гороскопу? Подробнее...','','<h3>Скорпион (24 октября - 22 ноября)</h3>\r\n<p>Девушки Скорпионы - очень своенравные, характерные личности. Для них важно не только внимание, но и сам подарок, и они не боятся себе в этом признаться. Девушки Скорпионы умеют сами проявлять внимание и тщательно продумывают свои подарки, а потому ждут этого и от окружающих.</p>\r\n<p><br />Женщины Скорпионы не воспринимают цветы как полноценный подарок. Для них это прекрасный знак внимания, достойный радости и приятных воспоминаний, но не более. А все дело в том, что Скорпионы любят индивидуальный подход.</p>\r\n<h4><br />Если Вы хотите выбрать цветы для девушки Скорпиона:</h4>\r\n<ul>\r\n<li>Обязательно узнайте, какие цветы у нее любимые, для Скорпионов важно, если вы проявите дополнительное внимание и покажете, что помните ее предпочтения.</li>\r\n<li>Присмотритесь к простым и лаконичным букетам без дополнительного декора вне зависимости от того, полевые это цветы или элегантные розы.</li>\r\n<li>Не забывайте о том, что хорошее впечатление производит только букет из свежих цветов, потому что они дольше простоят и выглядят аккуратнее.</li>\r\n<li>Поищите букеты и цветочные композиции из пионов, садовых роз, розовых гвоздик или эустом. Несмотря на свой противоречивый характер, девушки Скорпионы в восторге от нежных цветов.</li>\r\n</ul>\r\n<p>Если Вы выбираете подарок для женщины Скорпиона, проявите творческий подход, вспомните о ее сокровенных мечтах. Скорпионы обожают подарки, которые сделаны специально для них, а значит в них есть нечто, намекающее на их личность. Тем не менее у нас не всегда есть возможность думать слишком долго.</p>\r\n<h4><br />Отличным подарком может стать:</h4>\r\n<ul>\r\n<li><br />Ежедневник или интересный блокнот с набором для творчества</li>\r\n<li><br />Гифт бокс с разнообразными сладостями</li>\r\n<li><br />Большой набор со средствами по уходу за собой</li>\r\n<li><br />Винный набор для романтичного вечера на двоих, если вам посчастливилось быть в отношениях с девушкой Скорпионом</li>\r\n</ul>\r\n<p>Вы можете в любой момент обратиться к нам с вопросом о подарках или цветах и мы подберем что-то необычное конкретно для Вашего случая. С нами делать оригинальные подарки любимым и дорогим людям стало легче!</p>','2018-11-26 14:36:53'),
