VALUES
	(1,1,1,'Root','','root','','',''),
	(1,1,2,'Root','','root','','',''),
	(1,1,3,'Root','','root','','',''),
	(1,1,4,'Root','','root','','',''),
	(2,1,1,'Home','<p>There are many ways to congratulate a person with an important day, a new success or without any occasion, but the most pleasant are still flowers and original gifts. leave an unforgettable impression about yourself with Cadouri MD!</p>','home','Buy flowers and gifts with delivery Chisinau, Moldova','','Order flowers and gifts online from the cadouri.md website ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery acros Chisinau'),
	(2,1,2,'Home','<p>Există numeroase moduri de a felicita o persoană cu o sărbătoare, cu un nou succes sau simplu din sincere motive, dar cele mai plăcute felicitări totuși rămân florile și cadouri originale. lasă o impresie de neuitat despre tine împreună cu Cadouri MD!</p>','home','Cumpără flori și cadouri cu livrare în Chișinău, Moldova','','Comandă flori și cadouri online în magazinul cadouri.md ✓Buchete personalizate ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(2,1,3,'Home','<p><span style=\"font-size:8pt;font-family:Arial;\">Существует множество способов поздравить человека с праздником, с успехами или просто так, но самыми приятными все еще остаются цветы и красивые подарки. оставь о себе незабываемое впечатление вместе с Cadouri MD!</span></p>','home','Купить цветы и подарки с доставкой Кишинев, Молдова ','','Купить цветы и подарки в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨'),
	(2,1,4,'Home','','home','','',''),
	(3,1,1,'Flowers','<p><span style=\"font-size:8pt;font-family:Arial;\">Flowers are the best way to show love and attention to your loved ones. To all bouquets applies free delivery across Chisinau.</span></p>','flowers','Buy flowers with delivery Chisinau, Moldova','','Order flowers online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau'),
	(3,1,2,'Flori','<p><span style=\"font-family:Arial;\"><span style=\"white-space:pre-wrap;\">Un buchet de flori este cel mai bun mod de a arăta grija și atenția față de cei dragi. Orice buchet poare fi livrat gratuit pe teritora orașului Chișinău.</span></span></p>','flori','Cumpără flori cu livrare în Chișinău, Moldova','','Comandă flori online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ '),
	(3,1,3,'Цветы','<p><span style=\"font-size:8pt;font-family:Arial;\">Цветы это лучший способ, чтобы показать свою заботу и внимание своим любимым. Для всех букетов действует бесплатная доставка по Кишиневу.</span></p>','cvety','Купить цветы с доставкой Кишинев, Молдова ','','Купить цветы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(3,1,4,'Clothes','<p><span style=\"font-size:10pt;font-family:Arial;font-style:normal;\">Discover our favorites fashionable discoveries, a selection of cool items to integrate in your wardrobe. Compose a unique style with personality which matches your own.</span></p>','clothes','','',''),
	(5,1,1,'Custom Florist Design','<p><span style=\"font-size:10pt;font-family:Arial;font-style:normal;\">T-shirts, sweaters, hoodies and women\'s accessories. From basics to original creations, for every style. </span></p>','custom-florist-design','','',''),
	(5,1,2,'Women','<p><span style=\"font-size:10pt;font-family:Arial;font-style:normal;\">T-shirts, sweaters, hoodies and women\'s accessories. From basics to original creations, for every style. </span></p>','women','','',''),
	(5,1,3,'Women','<p><span style=\"font-size:10pt;font-family:Arial;font-style:normal;\">T-shirts, sweaters, hoodies and women\'s accessories. From basics to original creations, for every style. </span></p>','women','','',''),
	(5,1,4,'Women','<p><span style=\"font-size:10pt;font-family:Arial;font-style:normal;\">T-shirts, sweaters, hoodies and women\'s accessories. From basics to original creations, for every style. </span></p>','women','','',''),
	(11,1,1,'Gift Boxes','<p>Gift boxes are unusual gift-sets decorated with flowers. Gift boxes are always beautiful, interesting, and most importantly useful, beacuse it could be very sweet, tasty or spicy, or it can halp you take care about yourself with some SPA or cosmetic products, healthy natural sweets etc.</p>','gift-boxes','Buy gift boxes with delivery Chisinau, Moldova','','Order gift boxes online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Free delivery across Chisinau'),
	(11,1,2,'Gift Boxes','<p>Gift Boxes sunt seturi neobișnuite de cadouri, decorate cu flori. Un astfel de cadou este întotdeauna frumos, interesant și, cel mai important, util, deoarece fiecare set conține ceva gustos, sănătos, sau bun pentru pielea ta!</p>','gift-boxes','Cumpără gift boxes cu livrare în Chișinău, Moldova','','Comandă gift boxes online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate  ✓ Livrare gratuită în Chișinău'),
	(11,1,3,'Гифт Боксы','','gift-boksy','Купить гифт боксы с доставкой Кишинев, Молдова','','Купить гифт боксы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты  ✓ Бесплатная доставка по Кишиневу  ➨ Смотреть!'),
	(11,1,4,'Special Gifts','','special-gifts','','',''),
	(12,1,1,'Roses','<p>Roses are gentle and sensual flowes, they will melt the heart of any beautiful girl. And your beloved moms will be even more delighted with your attention.</p>','roses','Buy roses with delivery Chisinau, Moldova','','Order roses online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau ➨'),
	(12,1,2,'Trandafiri','<p><span style=\"font-family:Arial;\"><span style=\"font-size:10.6667px;\">Trandafiri sunt floarile blânde și senzuale. Vor topi inima oricărei fete frumoase. Și mamele vor fi  încântate de atenția acordată.</span></span></p>','trandafiri','Cumpără trandafiri cu livrare în Chișinău, Moldova','','Comandă trandafiri online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓Livrare gratuită în Chișinău'),
	(12,1,3,'Розы','<p>Роза - нежный и чувственный цветок - растопит сердце любой прекрасной девушке. А мамы будут в еще большем восторге от вашего внимания. </p>','rozy','Купить розы с доставкой Кишинев, Молдова','','Купить розы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(12,1,4,'Roses','','roses','','',''),
	(13,1,1,'Plants','<p>Plants will stand much longer than flowers in a bouquet. So why do not leave a beautiful flower like a memory of your gift?</p>','plants','Buy plants with delivery Chisinau, Moldova','','Order plants in the boxes online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery '),
	(13,1,2,'Plants','<p>Plantele vor sta mult mai mult decât florile în buchet. Deci, de ce să nu lăsați persoanei iubite mai mult, decât doar o amintire despre cadou, ci și o floare frumoasă?</p>','plants','Cumpără flori în vazon cu livrare în Chișinău, Moldova','','Comandă flori în vazon online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău ✓ Buchete personalizate ✓ Cadouri originale '),
	(13,1,3,'Комнатные Растения','<p>Комнатные растения простоят намного дольше, чем цветы в срезке. Так почему бы не оставить близкому человеку не только память о подарке, но и прекрасный цветок?</p>','komnatnye-rasteniya','Купить комнатные цветы с доставкой Кишинев, Молдова','','Купить комнатные цветы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨'),
	(13,1,4,'Plants','','plants','','',''),
	(15,1,1,'Plush Toys','<p>Plush toys also have a soul, and not only kids like to play with them! The finest and cutest rabbits, bears and other friends from the plush animal world can be purchased on our site with free delivery across the Chisinau!</p>','plush-toys','Buy plush toys with delivery Chisinau, Moldova','','Order plush toys online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Free delivery across Chisinau'),
	(15,1,2,'Plush Toys','<p>Jucăriile din pluș au, de asemenea, un suflet, și nu doar copiilor le place să se joace cu ele! Cele mai faine și drăguțe iepuri, urșii și alți prieteni din lumea animalelor de pluș pot fi achiziționați pe site-ul nostru cu livrare gratuită în Chișinău!</p>','plush-toys','Cumpără jucării pluș cu livrare în Chișinău, Moldova','','Comandă jucării pluș online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Livrare gratuită în Chișinău'),
	(15,1,3,'Plush Toys','','plush-toys','Купить плюшевые игрушки с доставкой Кишинев, Молдова','','Купить плюшевые игрушки в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  '),
	(15,1,4,'Plush Toys','','plush-toys','','',''),
	(16,1,1,'Fruit Baskets','<p><span style=\"font-size:8pt;font-family:Verdana;\">How many useful vitamins are in a fruit basket! Give your loved ones a vitamin charge and the sweet smell of tasty gifts of nature!</span></p>','fruit-baskets','Buy fruit baskets with delivery Chisinau, Moldova','','Order fruit baskets online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets  ✓ Free delivery across Chisinau'),
	(16,1,2,' Coși de Fructe','<p>Cât de multe vitamine utile sunt într-un coș mare de fructe! Oferiți-i celor dragi o încărcătură de vitamine și un miros dulce de daruri gustoase ale naturii!</p>','coi-de-fructe','Cumpără coși de fructe pentru bărbați în Chișinău, Moldova','','Comandă coșuri de fructe online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate  ✓ Livrare gratuită în Chișinău'),
	(16,1,3,' Корзины с Фруктами','<p>Как много полезных витаминов в большой корзине с фруктами! Подари своим близким витаминовый заряд и сладкий запах вкусных даров природы!</p>','korziny-s-fruktami','Купить корзины с фруктами с доставкой Кишинев, Молдова','','Купить корзины с фруктами в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу'),
	(16,1,4,'Fruit Baskets','','fruit-baskets','','',''),
	(17,1,1,'Sweet Boxes','<p>A sweet gift box isn\'t just tasty, but also very beautiful! Different variants of such a set are striking - we decorate them for any taste with different flower compositions and give them to you or your darlings with all our love!</p>','sweet-boxes','Buy sweet gift boxes with delivery Chisinau, Moldova','','Order sweet gift boxes online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets  ✓ Free delivery across Chisinau'),
	(17,1,2,'Sweet Boxes','<p><span style=\"font-size:8pt;font-family:Verdana;\">Setul dulce nu este doar gustos, dar, de asemenea, și foarte frumos! Diferite variante ale unui astfel de set sunt izbitoare - le decorăm pentru orice gust cu diferite compoziții de flori și le dăruim din inimă!</span></p>','sweet-boxes','Cumpără gift box dulce în Chișinău, Moldova','','Comandă gift box dulce online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Livrare gratuită în Chișinău ➨ Vezi pe site'),
	(17,1,3,'Sweet Boxes','<p><span style=\"font-size:8pt;font-family:Arial;\">Сладкий подарок-набор это не только вкусно, но и очень красиво! разнообразные вариации такого набора поражают - сладости на любой вкус мы украшаем цветочной композицией и дарим от чистого сердца!</span></p>','sweet-boxes','Купить сладкий гифт бокс с доставкой Кишинев, Молдова','','Купить сладкие гифт боксы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу'),
	(17,1,4,'Sweet Boxes','','sweet-boxes','','',''),
	(18,1,1,'SPA Boxes','<p>SPA set is an useful gift box for any occasion. It is perfect for taking care about your skin and to make every your day pleasant!</p>','spa-boxes','Buy SPA gift boxes with delivery Chisinau, Moldova','','Order SPA gift boxes online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓  Free delivery across Chisinau'),
	(18,1,2,'SPA Boxes','<p>Setul SPA este un cadou perfect pentru orice ocazie. Conține tot ce ai nevoie pentru a avea grijă de tine și pielea ta cu o plăcere deosebită!</p>','spa-boxes','Cumpără seturi SPA pentru baie cu livrare în Chișinău, Moldova','','Comandă seturi SPA online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓Livrare gratuită în Chișinău'),
	(18,1,3,'SPA Boxes','<p><span style=\"font-size:8pt;font-family:Arial;\">Подарочные наборы со SPA средствами это новая жизнь всем знакомого подарка. Изумительные наборы украшенные цветами это не только красивый, но и практичный подарок, который мы с любовью доставим к двери получателя. </span></p>','spa-boxes','Купить SPA наборы для ванны с доставкой Кишинев, Молдова','','Купить SPA наборы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  '),
	(18,1,4,'SPA Boxes','','spa-boxes','','',''),
	(19,1,1,'Mixed Bouquets','<p>Mixed bouquets are not just simple flowers, this is a unique combination of shades, shapes and meanings in one bunch of fresh flowers. In our store you can be original even giving flowers!</p>','mixed-bouquets','Buy bouquets with delivery Chisinau, Moldova','','Order bouquets online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓Original Gifts ✓ Free delivery across Chisinau'),
	(19,1,2,'Buchete Asortate','<p>Mixed bouquets are not just simple flowers, this is a unique combination of shades, shapes and meanings in one bunch of fresh flowers. In our store you can be original even giving flowers!</p>','buchete-asortate','Cumpără buchete de flori cu livrare în Chișinău, Moldova','','Comandă buchete online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  '),
	(19,1,3,'Смешанные букеты','<p>Смешанные букеты это не просто цветы, это уникальное сочетание оттенков, форм и смыслов в одной охапке свежих цветов. В нашем магазине можно быть оригинальным даже даря цветы!</p>','smeshannye-bukety','Купить букеты доставкой Кишинев, Молдова ','','Купить букеты в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите'),
	(19,1,4,'Mixed Boquets','','mixed-boquets','','',''),
	(21,1,1,'Sweets','<p>Sweets are always tasty and pleasant at any age. You can satisfy any sweet lover with our help!</p>','sweets','Buy sweets with delivery Chisinau, Moldova','','Order sweets online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau '),
	(21,1,2,'Sweets','<p>Dulciuri sunt întotdeauna gustoase și plăcute la orice vârstă. Gama largă a site-ului nostru va satisface orice iubitor de dulciuri!</p>','sweets','Cumpără dulciuri cu livrare în Chișinău, Moldova','','Comandă dulciuri online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău '),
	(21,1,3,'Sweets','<p><span style=\"font-size:8pt;font-family:Arial;\">Сладости - это всегда вкусно и приятно в любом возрасте. Ассортимент нашего сайта удовлетворит любого сладкоежку!</span></p>','sweets','Купить сладости с доставкой Кишинев, Молдова','','Купить сладости в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотри'),
	(22,1,1,'Flowers in Boxes','<p>Flowers in the box are elegant and refined. This is not an ordinary bouquet, but a whole flower composition in an interesting stylish box. Make a surprise for your loved ones!</p>','flowers-in-boxes','Buy flowers in boxes with delivery Chisinau, Moldova','','Order flowers in the boxes online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Original Gifts ✓ Free delivery across Chisinau'),
	(22,1,2,'Flori în Cutii','<p>Flori în cutie aratp elegant și rafinat. Acesta nu este un buchet obișnuit, ci o compoziție întreagă de flori într-o cutie elegantă. Faceți o surpriză pentru cei dragi!</p>','flori-in-cutii','Cumpără flori în cutie cu livrare în Chișinău, Moldova','','Comandă flori în cutii online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Cadouri originale ✓ Livrare gratuită în Chișinău'),
	(22,1,3,'Цветы в Шляпных Коробках','<p>Цветы в шляпной коробке - элегантно и утонченно. Это уже не обычный букет, а целая цветочная композиция в интересной стильной коробке. Сделайте своим близким сюрприз!</p>','cvety-v-shlyapnykh-korobkakh','Купить цветы в шляпной коробке с доставкой Кишинев, Молдова','','Купить цветы в шляпной коробке в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу'),
	(25,1,1,'Gifts','<p>Sometimes is very difficult to make an unusual and personalized gift. We can solve this problem for you. Free delivery within Chisinau is included.</p>','gifts','Buy gifts with delivery Chisinau, Moldova','','Order gifts online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau ➨'),
	(25,1,2,'Gifts','<p>Uneori este destul de greu să faci un cadou pe adevărat deosebit și personalizat, dar vă putem ajuta în realizarea unui cadou special cu mare drag! Livrarea gratuită pe teritoriul orașului Chișinău este inclusă.</p>','gifts','Cumpără cadouri cu livrare în Chișinău, Moldova','','Comandă cadouri online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  '),
	(25,1,3,'Подарки','<p>Иногда очень сложно сделать необычный, персонализированный подарок, но мы решим эту проблему за вас! Бесплатная доставка действует по всему Кишиневу.</p>','podarki','Купить подарки с доставкой Кишинев, Молдова ','','Купить подарки в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ '),
	(26,1,1,'Seasonal Limited Collection','<p>All seasons are good in their own way and each of them is rich in something different. We use the brightest and most beautiful gifts of nature to create truly amazing and unique floral compositions with seasonal flowers!</p>','seasonal-limited-collection','Buy seasonal flowers with delivery Chisinau, Moldova','','Order seasonal flowers online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Original Gifts ✓ Free delivery across Chisinau'),
	(26,1,2,' Colecția Sezonieră Limitată','<p>Toate anotimpurile sunt bune în felul lor și fiecare dintre ele este bogat în ceva diferit. Folosim cele mai strălucitoare și cele mai frumoase daruri ale naturii pentru a crea compoziții florale cu adevărat uimitoare cu flori sezoniere!</p>','colecia-sezoniera-limitata','Cumpără flori sezoniere pentru bărbați în Chișinău, Moldova','','Comandă flori sezoniere online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Cadouri originale ✓ Livrare gratuită în Chișinău'),
	(26,1,3,'Сезонная Ограниченная Коллекция','<p><span style=\"font-size:8pt;font-family:Arial;\">Все сезоны по своему хороши и каждый из них богат чем-то своим. Мы используем самые яркие и прекрасные дары природы для создания по настоящему удивительных и неповторимых цветочных композиций с сезонными цветами!</span></p>','sezonnaya-ogranichennaya-kollekciya','Купить сезонные цветы с доставкой Кишинев, Молдова','','Купить сезонные цветы в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ '),
	(27,1,1,'For Men','<p>Are you still thinking what gift to make for a man? Do you want to give your dad, husband or a good friend an unusual gift? Now men will definitely be satisfied by your gifts!</p>','for-men','Buy gifts for men with delivery Chisinau, Moldova','','Order gifts for men online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Free delivery across Chisinau'),
	(27,1,2,'Pentru Bărbați','<p>Vă mai chinuiți cu gândul ce să-i dăruiești unui bărbat? Vreți să-i cadonați ceva neobișnuit tatălui, soțului sau unui prieten bun? Acum bărbații vor fi cu siguranță mulțumiți de cadouri!</p>','pentru-barbai','Cumpără cadouri pentru bărbați în Chișinău, Moldova','','Comandă cadouri pentru bărbați online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Livrare gratuită în Chișinău'),
	(27,1,3,'Для Мужчин','<p><span style=\"font-size:8pt;font-family:Arial;\">Вы все еще мучитесь мыслью, что бы такого подарить мужчине? Вам хочется подарить своему папе, мужу или просто хорошему другу необычный подарок? Теперь мужчина точно останется доволен!</span></p>','dlya-muzhchin','Купить подарок для мужчины с доставкой Кишинев, Молдова','','Купить подарок для мужчины в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓Бесплатная доставка по Кишиневу'),
	(28,1,1,'Gifts with Express Delivery','<p>When you remembered at the last moment - Cadouri MD will help you stay brilliant. Contact us by phone or via chat and we will place an order for you if we have free couriers. Express delivery is available only in Chisinau.</p>','gifts-with-express-delivery','Buy flowers and gifts with express delivery in Chisinau','','Order flowers and gifts online with express delivery ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery acros Chisinau'),
	(28,1,2,'Cadouri cu Livrare Expres','<p>Când ți-ai adus aminte în ultima clipă de ce trebuia să pregătești încă de „ieri”, Cadouri MD îți vine de ajutor. Ia legătura cu noi prin chat sau telefon și în câteva clipe comanda ta va fi gata, dacă avem curier liber. Livrare urgentă doar prin Chișinău.</p>','cadouri-cu-livrare-expres','Cumpără flori și cadouri cu livrare expres în Chisinau','','Comandă flori și cadouri online cu livrare expres ✓Buchete personalizate ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(28,1,3,'Подарки с Экспресс Доставкой','<p>Когда вы вспомнили в последний момент и вам нужно на \"вчера\" - Cadouri MD спешит на помощь. Свяжитесь с нами по телефону или через чат и мы оформим для вас заказ, если у нас есть свободные курьеры. Экспресс доставка доступна только по Кишиневу. </p>','podarki-s-ekspress-dostavkoj','Купить цветы и подарки с доставкой за 3 часа по Кишиневу ','','Купить цветы и подарки c экспресс доставкой ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(29,1,1,'Christmas Collection','<p>Christmas and New Year\'s Eve are perfect to show your love to your darlings. With our beautiful Christmas Gifts you can be ingenious and inventive in your choise!</p>','christmas-collection','Buy Chrismas bouquets and gifts with delivery in Chisinau Moldova','','Order Chrismas bouquets and gifts online ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery acros Chisinau'),
	(29,1,2,'Colecția de Crăciun','<p>Revelion și Crăciunul sunt perfecte pentru a dărui persoanelor dragi o particică caldă a sufletului tău. Așteptatrea sărbătorilor poate deveni și mai emoțională cu ajutorul cadourilor nemaipomenite ce creează atmosfera unică de Crăciun!</p>','colecia-de-craciun','Cumpără buchete și cadouri de Crăciun cu livrare Chisinau Moldova','','Comandă buchete și cadouri de Crăciun online ✓Buchete personalizate ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(29,1,3,'Рождественская Коллекция','<p>Новый год и Рождество - идеально время, чтобы подарить близким людям свою заботу и любовь. Предвкушение праздника скрасит серые зимние дни, а красивые, словно с журнальных картинок подарки создадут теплую новогоднюю атмосферу!</p>','rozhdestvenskaya-kollekciya','Купить Новогодние Букеты или Подарки с доставкой Кишинев Молдова ','','Купить Новогодние Букеты или Подарки  ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(30,1,1,'For Kids ','<p>Children love getting presents! And it\'s not surprising, because there are so many toys and beautiful things in the world  that children dream to get. Here you can find a perfect solution for you and for your child!</p>','for-kids','Buy gifts for children with delivery in Chisinau Moldova','','Order gifts for kids online ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery across Chisinau'),
	(30,1,2,'Pentru Copii','<p>Copii adoră să primească cadouri! Și nu este ceva de mirat - atât de multe jucării și dulciuri există pe lume! Aici veți găsi o soluție și pentru bebeluși, și pentru copilași mai maturi!</p>','pentru-copii','Cumpără cadouri pentru copii cu livrare Chisinau Moldova','','Comandă cadouri pentru copii online  ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(30,1,3,'Для Детей ','<p>Дети просто обожают получать подарки! И неудивительно, ведь так много на свете игрушек и красивых вещей, которые мечтают заполучить дети. Тут найдется решение как для вас, так и для ребенка!</p>','dlya-detej','Купить подарки для детей с доставкой Кишинев, Молдова','','Купить подарки для детей  ✓ Доставка по всей Молдове ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(31,1,1,'Gift Baskets ','','gift-baskets','Buy gifts baskets with delivery in Chisinau Moldova','','Buy gifts baskets ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery across Chisinau'),
	(31,1,2,'Coșuri cu Cadouri ','','couri-cu-cadouri','Cumpără coșuri cu cadouri cu livrare Chisinau Moldova','','Cumpără coșuri cu cadouri ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(31,1,3,'Подарочные Корзины ','','podarochnye-korziny','Купить корзину с подарками с доставкой Кишинев, Молдова','','Купить корзину с подарками ✓ Доставка по всей Молдове ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(32,1,1,'Mono Bouquets','<p><span style=\"font-size:8pt;font-family:Arial;\">Mono bouquet is a bouquet of the same flowers. Today, mono bouquets become classic, not a lack of creativity. There are many connoisseurs of this type of bouquets, because such flowers look simple but aesthetically pleasing, without unnecessary details.</span></p>','mono-bouquets','Buy mono bouquets with delivery in Chisinau Moldova','','Order mono bouquet online ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery acros Chisinau ➨ View more!'),
	(32,1,2,'Buchete Mono ','<p>Buchet mono este un buchet compus doar din flori de același fel. Pentru ziua de astăzi buchete mono nu reprezintă lipsa abordării creative, ci invers, un gust estetic nobil. Un astfel de buchet arată și mai frumos, și mai elegant, și mai estetic.</p>','buchete-mono','Cumpără buchete mono cu livrare Chisinau Moldova','','Comandă buchet mono online ✓Buchete personalizate ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău   ➨ Vezi pe site!'),
	(32,1,3,'Моно Букеты ','<p>Моно букет - это букет из одинаковых цветов. На сегодняшний день моно букеты - это классика, а не отсутствие креативности. Есть множество ценителей данного вида букетов, ведь такие цветы выглядят просто, дорого и со вкусом, без лишних деталей.</p>','mono-bukety','Купить моно букеты с доставкой Кишинев Молдова ','','Купить моно букет онлайн  ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(33,1,1,'Tulips','<p><span style=\"font-size:8pt;font-family:Arial;\">Delicate tulips will delight anyone who missed the spring and wants to get a piece of spring mood. Tulips are a great way to congratulate beautiful women and girls on their day - the 8th of March. Our florist will collect you a bouquet of the freshest flowers, and the color scheme of the bouquet will be limited only by the possibilities of nature.</span></p>','tulips','Buy tulips with delivery in Chisinau Moldova','','Order tulips bouquet online ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery acros Chisinau ➨ View more!'),
	(33,1,2,'Lalele','<p>Lalele gingașe și fine vor bucura pe oricine, dăruind o particică de primăvară. Lalelele sunt perfecte pentru a face un cadou frumos cu ocazia sărbătorii frumoase de 8 martie. Florăreasa noastră va compune buchetul doar din cele mai proaspete flori, iar gama largă de culori este limitată doar de natură.</p>','lalele','Cumpără lalele cu livrare Chisinau Moldova','','Comandă buchet de lalele online ✓Buchete personalizate ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău  ➨ Vezi pe site!'),
	(33,1,3,'Тюльпаны','<p>Нежные и утонченные цветы тюльпаны порадуют любого, кто соскучился по весне и хочет заполучить кусочек весеннего настроения. Тюльпаны - это отличный способ поздравить прекрасных женщин и девушек с их днём - с праздником 8 марта. Наш флорист соберет вам букет из самых свежих цветов, а цветовая гамма букета будет ограничена только возможностями природы.</p>','tyulpany','Купить тюльпаны с доставкой Кишинев Молдова ','','Купить букет тюльпанов онлайн  ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
	(34,1,1,'St. Valentine\'s Day ','<p>Valentine\'s Day is one of the favorite holidays of all women. Not only girls are happy about this holiday, men also like to receive romantic gifts! Here you can easily find a gift solution for February 14th.</p>','st-valentine-s-day','Buy valentines day gifts with delivery in Chisinau Moldova','','Buy romantic gifts online ✓ Deliver everywhere across Moldova ✓ Personalized Bouquets and Gifts ✓ Free delivery across Chisinau'),
	(34,1,2,'Ziua Îndrăgostiților','<p>Ziua Îndrăgostiților este una dintre cele mai preferate sărbători ale tuturor femeilor, dar nu doar fetele îl preferă. Bărbații la fel preferă să primească cadouri romantice! Aici puteți găsi cu ușurință un cadou frumos pentru 14 februarie.</p>','ziua-indragostiilor','Cumpără cadou ziua îndrăgostiților cu livrare Chisinau Moldova','','Cumpără cadou romantic Dragobete ✓ Cadouri originale ✓ Livrare pe tot teritoriul Moldovei și gratuit în Chișinău '),
	(34,1,3,'День Святого Валентина ','<p>День Влюбленных или День Святого Валентина - это один из любимейших праздников всех женщин.Но рады этому празднику не только девушки, мужчинам тоже нравится получать романтические подарки! Здесь вы с легкостью найдете решение для подарка на 14 февраля. </p>','den-svyatogo-valentina','Купить подарок 14 февраля с доставкой Кишинев, Молдова','','Купить подарок на День Влюбленных ✓ Доставка по всей Молдове ✓ Букеты от флориста ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!'),
