INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`)
VALUES
	(1,1,1,'Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
	(1,2,1,'Livrare','Termenii și condițiile noaste de livrare','conditii, livrare, intarziere, expediere, ambalaj','<h2>Expedieri și returnări</h2>\n<h3>Expedierea pachetului dumneavoastră</h3>\n<p>Pachetele sunt în general trimise în 2 zile de la primirea plății și sunt expediate prin UPS cu urmărire și livrare fără semnătură. Dacă preferați livrarea prin UPS Extra cu semnătură obligatorie, va fi aplicat un cost adițional, astfel că vă rugăm să ne contactați înainte de a alege această metodă. Orice metodă alegeți, veți avea o legătură pentru urmărirea online a pachetului dumneavoastră.</p>\n<p>Costul livrării include costul procesării și ambalării, cât și costurile poștale. Costul procesării este fix, în timp ce costul transportului poate varia în funcție de greutatea totală a pachetului. Vă sfătuim să vă grupați toate articolele într-o singură comandă. Noi nu putem grupa comenzi distincte plasate separat, astfel că fiecăreia i se vor aplica costuril de livrareand shipping fees will apply to each of them. Riscurile aferente livrării cad în responsabilitatea dumneavoastră, dar luăm măsuri speciale pentru a proteja obiectele fragile.<br /><br />Cutiile sunt generos dimensionate și articolele dumneavoatră sunt bine protejate.</p>','livrare'),
	(1,3,1,'Доставка','Сроки и условия доставки','условия, доставка, сроки, отправка, упаковка','<h2>Доставка и возврат</h2>\n<h3>Отправка Вашего товара</h3>\n<p>Отправка товара осуществляется через 2 дня после получения оплаты и отправляются через UPS с отслеживанием местоположения посылки и отгрузки без обязательной подписи. При выборе доставки через UPS Extra с обязательной подписью, с Вас будет взиматься дополнительная плата. Перед выбором способа доставки, просим связаться с нами. Вне зависимости от выбранного Вами способа оплаты, Вы сможете отслеживать состояние Вашего заказа онлайн.</p>\n<p>Стоимость доставки включает в себя расходы на обработку, упаковку и почтовые расходы. Затраты на обработку фиксированы, в то время как расходы на транспортировку могут варьироваться в зависимости от веса посылки. Мы советуем Вам объединять заказы. Мы не сможем объединить два отдельных заказа и доставка будет расчитана для каждого из них. Отправка товара будет на Вашей ответственности, но мы позаботимся о сохранности хрупких грузов.<br /><br />Коробки оптимального размера и с хорошим кровнем защиты.</p>','delivery'),
	(1,4,1,'Доставка','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
	(2,1,1,'Legal Notice','Legal notice','notice, legal, credits','<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>','legal-notice'),
	(2,2,1,'Notificare legală','Notificare legală','notificare, legala, acreditari','<h2>Legale</h2><h3>Acreditări</h3><p>Concept și producție:</p><p>Acest magazin online a fost creat folosind <a href=\"http://www.prestashop.com\">aplicația de comerț electronic PrestaShop</a>,răsfoiți <a href=\"http://www.prestashop.com/blog/en/\">blogul despre comerț electronic al PrestaShop</a> pentru noutăți și sfaturi despre vânzarea online și administrarea unui site de comerț electronic.</p>','notificare-legala'),
	(2,3,1,'Правовое положение','Правовое положениe','правовое положение, права','<h2>Правовое положение</h2><p>Производство:</p><p>Этот сайт был создан на <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; ПО с открытым доступом </p>','legal-notice'),
