	(5,4,1,'Secure payment','Our secure payment method','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this service</p>','secure-payment'),
	(6,1,1,'Payment & Delivery Policy','','','<h2>Delivery Times:</h2>\n<p><em><strong>The Same Day delivery:</strong></em></p>\n<p>If you want your order to be delivered the same day you have to place it before 12:00 PM. Please notice that the same day delivery option is available only for Chisinau and its surrounding area.</p>\n<p><em><strong>Regular Delivery:</strong></em></p>\n<p>If you place your order after 12:00 PM we can deliver it the next day between 11:00 AM and 11:00 PM.</p>\n<p>If you place your order at least one business day in advance you can choose any delivery time, even during the night hours.</p>\n<p>We cannot guarantee an exact delivery time, as this depends on the availability of our logistics partners. Plus-minus one hour fluctuation is acceptable. </p>\n<h2>Delivery Charges:</h2>\n<p>The delivery is free of charge within Chisinau city.</p>\n<p><em>The additional charge is applied to other regions in Moldova. See the list of cities with delivery cost.</em></p>\n<h2>Cancellations:</h2>\n<p>If you cancel your order at least five bank working days prior to the scheduled delivery date, you will be entitled to a full refund. For instance, if your order is scheduled for 16 March, you must contact us before 7 pm (EET) on 10 March.</p>\n<p>If notice of cancellation is given between five and two bank working days before the delivery date, an administrative fee of €10 will be deducted from your refund. For instance, if your order is to be delivered on 16 March, you must contact us before 7 pm (EET) on 13 March.</p>\n<p>If the order is cancelled less than two bank working days prior to the delivery date, no refund will be issued.</p>\n<h2>Special Requests:</h2>\n<p>You can use the special request box to provide more details to the florist (desired delivery time, additional information for the address, extra phone number etc). Under no circumstances can we guarantee that special requests will be met. If such requests cannot be met, you will not be entitled to a refund.</p>\n<h2>Flowers’ Quality Policy:</h2>\n<p>Our flower arrangements are unique and handcrafted, so no two arrangements are ever the same. Every effort is made to match orders as closely as possible to the product photographs and descriptions. While slight variations are sometimes necessary, the concept and quality of the item ordered are always guaranteed.</p>\n<p>Products only contain the items listed in the descriptions. Vases and other items are not included, unless explicitly stated in the product description. Photographs of flower bouquets represent the average bouquet size. There may be minor variations in the bouquet’s composition and shape.</p>\n<h2>Product Substitution Policy:</h2>\n<p>From time to time, our local florists may not have some items listed in the product description in stock, and substitutions of items of equal or greater value will be necessary.</p>\n<p>Should the main flower type in the bouquet have to be replaced, we will attempt to notify you; if we are unable to reach you, we will proceed with the substitution to prevent delays in the order delivery. Roses, however, will never be substituted with other flowers without requesting your confirmation first. At the same time, please note that if we do not hear from you within 24h from our first email we will proceed with delivery of your order to avoid further delays. We will substitute them with flowers of the same or greater value.</p>\n<h2>Color Substitution Policy:</h2>\n<p>Our florist may make changes to the colour of the flowers, but will maintain the overall shades of the bouquet displayed on the website.</p>\n<p>Moreover, we cannot guarantee that the colour shade will perfectly match the one shown in the picture. For instance, a pink bouquet may be presented in a paler or a deeper shade. Same with white coloured flowers, the shade may vary.</p>\n<p>In the event of more extreme colour changes, we will attempt to contact you to inform you. However, if we are unable to reach you, we will proceed with the colour substitution to prevent delays in the order delivery. </p>\n<h2>Refund Requests and Claims:</h2>\n<p><em><strong>Quality Claims:</strong></em></p>\n<p>If you are not satisfied with the quality of your order, you may request a refund by submitting a claim within two business days after the delivery date. Please submit your claim using your Cadouri.md account, including your contact information.</p>\n<p><em><strong>Late Deliveries:</strong></em></p>\n<p>In the event of any other issues such as non delivery claim, missing product etc. we kindly request you to submit your claim within 7 days always indicating your order number, please note claims submitted after this period will not be accepted.</p>\n<p>If, on the other hand, we are unable to make a delivery due to circumstances beyond our control (for instance, the recipient is not at home), you will not be entitled to a refund. Nevertheless, should the recipient be unavailable when we attempt delivery, we generally leave a note or call to schedule a new delivery time.</p>\n<p>In case of gifts if the order is more than 3 days late you will be entitled to a full refund once the recipient refuses to accept the package.</p>\n<h2>Incorrect or Incomplete Delivery Information:</h2>\n<p>If you provide us with incorrect or incomplete delivery information on placing your order, we will not be able to guarantee delivery. If our delivery personnel report that the delivery address is incorrect, we will attempt to contact you to confirm the details or to acquire additional information from you. </p>\n<p>Cadouri MD will not be liable if your order cannot be delivered due to incorrect or incomplete delivery information, and you will therefore not be entitled to a refund.</p>\n<h2>Deliveries Rejected by the Recipient:</h2>\n<p>If, for whatever reason, the recipient refuses to accept the delivery, you will not be entitled to a refund.</p>\n<h2>Currency:</h2>\n<p>Though there is the option of viewing the product price in other currencies, orders will always be charged in Moldavian Lei . Cadouri MD displays the prices in other currencies, but these conversions are only an approximation.</p>\n<h2>Edible Products:</h2>\n<p>We do not produce or store any edible products. We procure them on the day of delivery and provide the service of delivering them from our partners.</p>\n<h2>Foto &amp; Video Upon Delivery:</h2>\n<p>Although we provide the additional service of making photo upon a successful delivery free of charge. We do not guarantee it, as recipient may refuse to be photographed.</p>\n<p></p>','payment-delivery-policy'),
	(6,2,1,'Livrarea & Plata','','','<h2>Termenul livrării:</h2>\n<p><em><strong>Livrarea express în ziua plasării comenzii:</strong></em></p>\n<p>Dacă doriți ca florile să fiu livrate pe data deplasăriii comenzii, trebuie să plasați comanda înainte de ora 12:00. Livrarea express (livrarea în ziua de plasare a comenzii) este disponibilă doar cu livrarea pe teritoriul orașului Chișinău și a municipiilor alăturate.</p>\n<p><em><strong>Livrarea Standart:</strong></em></p>\n<p>În caz dacă plasați comanda după ora 12:00, o putem livra doar următoarea zi la orice ora, începând cu ora 11:00 și până la 23:00.</p>\n<p>Dacă plasați comanda din timp (minim 2 zile lucrătoare înainte de data livrării) puteți alege orice oră doriți, inclusiv și noaptea.</p>\n<p>Nu putem garanta o precizie absolută ce ține de ora livrării, deseori depindem de partenerii noștri in domeniul de logistică. Ora livrării poate varia de la 1 până la 2 ore.</p>\n<h2>Costul Livrării:</h2>\n<p>Livrarea gratuită se efectuiază doar pe teritoriul orașului Chișinău.</p>\n<p>În cazul livrării în alte regiuni ale Republicii Moldova se percepe o taxă adăugătoare. Puteți vedea lista destinațiilor și a prețurilor accesând link-ul.</p>\n<h2>Anularea Comenzii:</h2>\n<p>Dacă anulați comanda cel puțin cu 5 zile lucrătoare* înainte de data planificată a livrării, veți avea dreptul la returnarea sumei bănești în întregime. Spre exemplu, dacă comanda a fost planificată pe data de 16 martie, trebuie să ne contactați până pe data de 10 martie, ora 19:00 (EET)</p>\n<p> Dacă notificarea despre anularea comenzii are loc înainte cu 5-2 zile lucrătoare* înainte de livrarea planificată, taxa administrativă în valoarea de 10 euro va fi extrasă din suma rambursării. Spre exemplu, dacă comanda trebuie să fie livrată pe data de 16 martie, trebuie să ne contactați înainte de 13 martie, ora 19:00 (EET)</p>\n<p>Dacă comanda va fi anulată mai puțin decât cu 2 zile lucrătoare* înainte de data livrării, rambursarea nu va fi efectuată.</p>\n<p>* Zilele lucrătoatre se consideră cele ale băncii. Magazinul Cadouri MD lucrează fără de zile libere.</p>\n<h2>Sugestii suplimentare:</h2>\n<p>Puteți utiliza un câmp special pe pagina de comandă pentru a oferi mai multe informații florarului (informații suplimentare pentru adresa, numărul de telefon suplimentar etc.). În nici un caz nu putem garanta că toate dorințele dvs. suplimentare vor fi îndeplinite. Dacă nici o sugestie nu poate fi executată, aceasta nu poate servi ca o cauză majoră pentru o rambursare.</p>\n<h2>Calitatea florilor:</h2>\n<p>Compozițiile noastre floristice sunt unice deoarece sunt fabricate manual. Deaceea două compoziții asemănătoare nu pot fi absolut identice. Facem tot posibilul pentru ca rezultatul să fie apropiat maximal către exemplu-model de pe web-site-ul nostru. Câteodata totuși avem nevoie să facem careva modificări. Vă putem garanta că gama buchetului și se va păstra.</p>\n<p>Produsul conține doar elementele enumerate în descriere. Vasele și alte articole din fotografii nu sunt incluse în comandă, cu excepția cazului în care în descriere se menționează altfel în mod explicit. Buchetul din imagine reprezintă dimensiunea medie a buchetului. Deoarece nu există două flori identice în natură, puteți remarca mici schimbări în compoziția și forma buchetului.</p>\n<h2>Politica de substituire a florilor:</h2>\n<p>Din când în când la furnizorii noștri pot lipsi careva elemente pentru compunerea buchetului din ceea ce este indicat in descrierea produsului. În acest caz vom înlucui elementul necerar pe unul de cost egal sau mai mare, decât cel precedent.</p>\n<p>În caz dacă suntem nevoiți să înlocum tipul principal de flori în buchet vom încerca să va contactăm pentru a vă preîntâmpina; dacă nu vă putem contacta vom substitui florile fără acordul Dvs. pentru a preîntâmpina livrarea întârziată. Vă atragem atenția că trandafirii nu for fi niciodată substituiți.</p>\n<h2>Politica de substituire a culorilor:</h2>\n<p>Florarul nostru poate face careva modificări ce ține de culorile florilor, dar păstrând combinația culorilor la general. Puteți compara cu exemplu de pe web-site-ul nostru.</p>\n<p>La fel nu vă putem garanta că nuanțe de culori se vor potrivi perfect nuanțelor de la imaginea-exemplu de pe web-site. Spre exemplu un buchet roz poate avea în realitate o nuanță mai spre cumoare mov sau mai căpșunie, decât buchetul reprezentat pe imagine. Tot aceeași situație o putem întâlni cu nuanțele de alb, ce poate să fie mai gălbui sau mai verzui decât în imaginea-exemplu.</p>\n<p>În caz dacă culorile sunt schimbate mai serios decât a fost afirmat mai sus vom încerca să vă contactăm pentru a vă informa din timp. Dar dacă nu vă vom putea contacta atunci vom substitui culoarea pentru a preîntâpina livrarea întârziată.</p>\n<h2>Politica de rambursare:</h2>\n<p><em><strong>Revendicări la calitate:</strong></em></p>\n<p>Dacă nu sunteți satisfăcut cu calitatea comenzii puteți să ne contactați referitor la o compensare. Trimiteți un mesaj cu indicarea contactelor Dvs. cu ajutorul profilului Dvs. pe web-site-ul Cadouri MD.</p>\n<p><em><strong>Livrarea cu întârziere:</strong></em></p>\n<p>În caz dacă apar alte probleme sau întrebări, (ca exemplu livrarea întârziată, lipsa unui produs etc.) vă rugăm să ne contactați în perioada de 7 zile indicând numărul comenzii. Vă rugăm să atrageți atenția că reclamațiile Dvs. nu vor fi admise după perioada de 7 zile.</p>\n<p>Dacă nu putem efectua livrarea comenzii din cauza unor circumstanțe ce nu depind de noi (spre exemplu destinatar n-a fost acasă la momentul livrării) nu veți avea dreptul la restituirea banilor. Dar în astfel de situații de obicei lăsăm o notiță scrisă sau încercăm să-l contactăm la telefon pentru a planifica o altă oră de livrare.</p>\n<p>În caz de livrarea întârziată (mai mult decât cu 3 zile) și renunțarea destinatarului de a primi cadou din cauza întârzierii aveți dreptul la o rambusrare.</p>\n<h2>Informația greșită destre adresa livrării:</h2>\n<p>Dacă ne furnizați informații incorecte sau incomplete la momentul plasării a comenzii, nu vă putem garanta livrarea. Dacă curierul nostru raportează că adresa de livrare este incorectă, vom încerca să vă contactăm pe Dvs. sau pe destinatar pentru a confirma datele sau pentru a obține informații suplimentare.</p>\n<p>Cadouri MD nu poartă răspundere dacă comanda Dvs. nu poate fi livrată din cauza informației greșite sau incomplete despre destinatar. În acest caz nu veți avea dreprul la restituirea banilor.</p>\n<h2>Abandonarea comenzii de către destinatar:</h2>\n<p>Dacă destinatar refuză la primirea cadoului (indifirent de cauză) nu veți avea dreptul la returnarea banilor.</p>\n<h2>Valuta:</h2>\n<p>Cu toate că aveți posibilitatea de a vedea prețurile în valute diferite, valuta principală a site-ului nostru în care se va lua plata este leu moldovenesc (MDL). Cadouri MD afișează prețurile în diferite valute, dar conversiunile sunt aproximate.</p>\n<h2>Produse comustibile:</h2>\n<p>Nu producem și nu păstrăm nici un fel de produse alimentare. Le transportăm direct de la partenerii noștri în ziua de efectuare a comenzii. Astfel oferim doar serviciul de livrare.</p>\n<h2>Foto și video la livrare:</h2>\n<p>În pofida faptului că vă oferim serviciul gratuit de fotografiere a livrării cadoului, nu putem garanta efectuarea ei. Destinatar poate refuza să facă fotografii.</p>','livrarea-plata'),
	(6,3,1,'Доставка & Оплата','','','<h2>Доставка &amp; Оплата</h2>\n<p><em><strong>Сроки Доставки:</strong></em></p>\n<p>Экспресс доставка в день заказа:</p>\n<p>Если вы хотите, чтобы цветы были доставлены в день размещения заказа, вы должны оформить заказ до 12:00 часов дня. Экспресс доставка (доставка в день размещения заказа) доступна только по Кишиневу и прилегающим городам и селам.</p>\n<p><em><strong>Стандартная доставка:</strong></em></p>\n<p>Если вы размещаете заказ после 12:00 часов дня, мы сможем доставить его только начиная со следующего дня, в любое время с 11:00 до 23:00.</p>\n<p>Если вы размещаете заказ заранее (минимум за 2 рабочих дня от даты доставки), вы можете выбрать любое время доставки, влючая ночные часы.</p>\n<p>Мы не гарантируем абсолютную точность по времени доставки, часто мы зависим от наших партнеров по логистике. Время доставки может колебаться от 1 до 2-х часов. </p>\n<h2>Стоимость Доставки:</h2>\n<p>Бесплатная доставка производится только в пределах Кишинева. </p>\n<p>При доставке в другие регионы Молдовы мы взимаем дополнительную плату. Просмотреть список городов и стоимость доставки можно по ссылке. </p>\n<h2>Отмена Заказа:</h2>\n<p>Если вы отмените свой заказ минимум за 5 банковских рабочих дней до запланированной даты доставки, вы получите полное возмещение потраченной суммы. Например, если ваш заказ запланирован на 16 марта, вы должны связаться с нами до 10 марта 19:00 по молдавскому времени.</p>\n<p>Если уведомление об отмене заказа предоставляется за 5-2 банковских рабочих дня до планируемой даты доставки, административный сбор в размере 10 евро будет вычтен из вашего возмещения. Например, если ваш заказ должен быть доставлен 16 марта, вы должны связаться с нами до 13 марта 19:00 по молдавскому времени.</p>\n<p>Если заказ отменен менее чем за 2 банковских рабочих дня до даты поставки, возврат средств не будет произведен.</p>\n<h2>Дополнительные Пожелания:</h2>\n<p>Вы можете использовать специальное поле на странице оформления заказа, чтобы предоставить более подробную информацию флористу (дополнительная информация для адреса, дополнительного номера телефона и т. д.). Ни при каких обстоятельствах мы не можем гарантировать, что будут выполнены все ваши дополнитрельные пожелания. Если какой-то запрос не может быть выполнен, это не являтся поводом для возмещения потраченных средств.</p>\n<h2>Качество Цветов:</h2>\n<p>Наши цветочные композиции уникальны и изготовлены вручную, поэтому две композиции никогда не бывают одинаковыми. Прилагаются все усилия, чтобы максимально приблизить заказы к фотографиям и описаниям продуктов, но иногда требуются небольшие изменения. Однако мы гарантируем сохранение общей гаммы и настроения букета.</p>\n<p>Товары содержат только элементы, перечисленные в описании. Вазы и другие предметы с фотографий не включаются в заказ, если обратное явно не указано в описании. Букет на изображении представляет собой средний размер букета. Так как в природе не существуют два идентичных цветка, вы можете заметить незначительные изменения в составе и форме букета.</p>\n<h2>Политика замены цветов:</h2>\n<p>Время от времени у поставщиков могут отсутствовать некоторые элементы букета, указанные в описании товара. В таком случае мы произведем замену на другие элементы равной или большей стоимости.</p>\n<p>При необходимости замены основного типа цветка в букете, мы постараемся уведомить вас; если мы не сможем связаться с вами в течение 24 часов с нашей первой попытки, мы продолжим замену, чтобы предотвратить задержку в доставке подарка. Мы заменим их цветами того же или большего значения. Розы, однако, никогда не будут заменены другими цветами, без вашего согласия. </p>\n<h2>Политика замены цвета:</h2>\n<p>Наш флорист может внести изменения в цвет цветов, сохраняя при этом общую гамму букета, отображаемую на веб-сайте.</p>\n<p>Кроме того, мы не можем гарантировать, что цветовой оттенок будет идеально соответствовать изображенному на картинке. Например, розовый букет может быть представлен в бледном или более глубоком оттенке. То же самое с цветами белого цвета, оттенок может варьироваться.</p>\n<p>В случае более значительных изменений цвета мы попытаемся связаться с вами, чтобы сообщить вам. Однако, если мы не сможем связаться с вами, мы продолжим замену цвета, чтобы предотвратить задержку в доставке. </p>\n<h2>Политика возврата:</h2>\n<p><em><strong>Претензии к качеству:</strong></em></p>\n<p>Если вы не удовлетворены качеством своего заказа, вы можете потребовать возмещение, отправив запрос в течение двух рабочих дней после даты поставки. Отправьте свои претензии, используя свою учетную запись Cadouri.md, включая вашу контактную информацию.</p>\n<p><em><strong>Доставка с опозданием:</strong></em></p>\n<p>В случае возникновения каких-либо других проблем, таких как несвоевременная доставка, отсутствие продукта и т. д. мы просим вас подать заявку в течение 7 дней, с указанием номера вашего заказа. Пожалуйста, обратите внимание, что претензии, поданные после этого периода, не будут приняты.</p>\n<p>Если мы не можем выполнить доставку по независящим от нас обстоятельствам (например, получателя нет дома), вы не будете иметь право на возмещение. Однако, если получатель недоступен при попытке доставки, мы обычно оставляем записку или звоним, чтобы запланировать новое время доставки.</p>\n<p>В случае опоздания более чем на 3 дня, вы получите полное возмещение после того, как получатель откажется принять подарок.</p>\n<h2>Неправильная информация об адресе доставки:</h2>\n<p>Если вы предоставите нам неправильную или неполную информацию о доставке при оформлении заказа, мы не сможем гарантировать доставку. Если наш курьер сообщит, что адрес доставки неверен, мы постараемся связаться с вами или с получателем, чтобы подтвердить данные или получить дополнительную информацию.</p>\n<p>Cadouri MD не несет ответственности, если ваш заказ не может быть доставлен из-за неправильной или неполной информации о доставке. В таком случае вы не будете иметь право на возмещение.</p>\n<h2>Отказ получателя:</h2>\n<p>Если по какой-либо причине получатель отказывается принять подарок, вы не будете иметь право на возврат средств.</p>\n<h2>Валюта:</h2>\n<p>Несмотря на возможность просмотра цены товаров в других валютах, стоимость заказа всегда будет взиматься в молдавских леях. Cadouri MD отображает цены в других валютах, но эти конверсии являются лишь приблизительными.</p>\n<h2>Съедобные товары:</h2>\n<p>Мы не производим и не храним какие-либо пищевые продукты. Мы забираем их в день выполнения заказа у наших партнеров и предоставляем только услугу по их доставке.</p>\n<h2>Фото и видео с доставки:</h2>\n<p>Несмотря на то, что мы предоставляем бесплатную услугу фотографий с доставки, мы не гарантируем ее выполнение, так как получатель может отказаться от фотографирования.</p>','dostavka-oplata'),
	(7,1,1,'Privacy Policy','','','<h2>Privacy Policy</h2>\n<p>When you visit the Cadouri MD site you may provide us with two types of information: personal information you knowingly choose to disclose that is collected on an individual basis and website usage information collected on an aggregate basis as you and others browse our website.</p>\n<h2>Personal Information You Choose to Provide</h2>\n<p>Cadouri MD will not share your submitted information with any third parties. Our lists are private and are not sold or exchanged with outside entities. </p>\n<h2>Website Use Information</h2>\n<p>Like other commercial websites, the Cadouri MD website utilizes Web server logs to collect information regarding how our website is used. Information gathered through cookies and web server logs may include the date and time of visits, the pages viewed, time spent at our website, and the websites visited just prior to and after our website. This information is collected on an aggregate basis. None of this information is associated with you as an individual, and your individual usage.</p>\n<h2>What are cookies</h2>\n<p>Cookies are tiny text files that are stored on your computer when you visit our website. Thanks to the information stored in cookies, your preferences are remembered when you return to the website and you thereby enjoy a better browsing experience.</p>\n<p>If you prefer to disable cookies, you can do so by modifying your browser settings. However, this may prevent some parts of our site from functioning properly, as they play an essential role in the provision of our services.</p>\n<h2>Use of Website Information</h2>\n<p>Content included in this site may be used by you solely for personal, informational, and/or non-commercial purposes and may not be modified or altered in any way. Except as expressly provided herein, you may not use, download, upload, copy, print, display, perform, reproduce, publish, license, post, transmit or distribute any information from this website in whole or in part without prior written consent from Cadouri MD.</p>\n<h2>Consent</h2>\n<p>By using the Cadouri MD website you consent to our collection and use of your personal information as described in this Privacy Policy. If we change our privacy policies and procedures, we will post those changes on our website to keep you aware of what information we collect, how we use it and under what circumstances we may disclose it. If you do not agree with these changes, your sole recourse is to discontinue use of the website.</p>','privacy-policy'),
	(7,2,1,'Politica de Confidentialitate','','','<h2>Politica de confidentialitate</h2>\n<p>În timp ce navigați web-site-ul Cadouri MD ne furnizați 2 tipuri de informație: informația personală pe care o furnizați la momentul efectuării cumpărăturilor (atunci, când indicați datele peronale despre numele, prenumele, adresa, număru de telefon etc.) și informația despre utilizarea site-ului nostu în timp ce navigați pe el (informația se culege în regimul independent cu ajutorul instrumentelor noastre de analizare.)</p>\n<h2>Informația personală</h2>\n<p>Cadouri MD nu va transmite informația furnizată de Dvs. către terți. Datele Dvs. se vor păstra confidențial și nu sunt supuse vânzării sau schimbului. </p>\n<h2>Informația despre utilizarea web-site-ului</h2>\n<p>La fel ca și alte site-uri comerciale, site-ul Cadouri MD utilizează jurnale web pentru a colecta informații despre modul în care site-ul nostru este utilizat. Informațiile colectate prin cookie-uri și jurnalele serverului web pot include data și ora vizitelor, paginile vizualizate, timpul petrecut pe site-ul nostru și site-urile vizitate chiar înainte și după site-ul nostru. Aceste informații sunt colectate în mod cumulativ. Niciuna dintre aceste informații nu este asociată cu dvs. fie ca persoană fizică, fie ca utilizator individual.</p>\n<h2>Ce prezintă fișiere Cookies?</h2>\n<p>Fișiere cookies sunt fișierele mici, ce se păstrează în memoria calculatorului Dvs. în timp ce navigați pe web-site-ul nostru. Cu ajutorul înformației care se depozitează în aceste fișiere cookies site-ul nostru memorizează preferințele Dvs. când vă întoarceți pe web-site. Astfel site-ul se adaptează mai bine nevoilor Dvs.</p>\n<p>Dacă doriți sa deconectați fișierele cookies puteți să modificați setările browser-ului Dvs. Dar vă aducem la cunoștință, că aceasta poate dăuna funcționării corecte a unor părți importante a web-site-ului nostru. Aceasta poate dăuna la fel și furnizării serviciilor noastre.</p>\n<h2>Utilizarea informației de pe web-site</h2>\n<p>Conținutul acestui site poate fi utilizat de dvs. doar în scopuri personale, informative și/sau necomerciale și nu poate fi modificat de dvs. în nici un fel. Cu excepția cazurilor menționate direct în acest document, nu aveți dreptul să utilizați, să încărcați, să publicați, să copiați, să tipăriți, să afișați, să efectuați, să reproduceți, să licențiați, să transmiteți sau să distribuiți toate informațiile din acest site integral sau parțial fără consimțământul prealabil scris al site-ului Cadouri MD.</p>\n<h2>Acord</h2>\n<p>Prin utilizarea site-ului Cadouri MD sunteți de acord în mod automat cu colectarea și utilizarea informațiilor personale, așa cum este descris în această politică de confidențialitate. Dacă ne schimbăm politicile și procedurile de confidențialitate, vom posta aceste modificări pe site-ul nostru, astfel încât să știți ce informații colectăm, cum le folosim și în ce circumstanțe le putem dezvălui. Dacă nu sunteți de acord cu aceste modificări, singurul remediu este să opriți utilizarea site-ului Cadouri MD.</p>','politica-de-confidentialitate'),
	(7,3,1,'Политика Конфиденциальности','','','<h2>Политика Конфиденциальности</h2>\n<p>При посещении сайта Cadouri MD вы предоставляете нам два типа информации: личную информацию, которую вы раскрываете самостоятельно при оформлении заказа, и информацию об использовании веб-сайта, которая собирается автономно инструментами аналитики, когда вы и другие пользователи просматривают наш веб-сайт.</p>\n<h2>Персональные данные покупателя</h2>\n<p>Cadouri MD не будут передавать предоставленную вами информацию третьим лицам. Ваши данные хранятся конфиденциально и не подлежат продаже или обмену. </p>\n<h2>Информация об использовании Веб-Сайта</h2>\n<p>Как и другие коммерческие сайты, веб-сайт Cadouri MD использует веб-журналы для сбора информации о том, как используется наш веб-сайт. Информация, собранная с помощью файлов cookie и журналов веб-сервера, может включать дату и время посещений, просмотренные страницы, время, проведенное на нашем веб-сайте, и сайты, посещаемые непосредственно перед и после нашего веб-сайта. Эта информация собирается на совокупной основе. Ни одно из этих сведений не связано с вами ни как с физическим лицом, ни с вашим индивидуальным использованием.</p>\n<h2>Что такое файлы Cookies?</h2>\n<p>Файлы cookies - это крошечные текстовые файлы, которые хранятся на вашем компьютере при посещении нашего веб-сайта. Благодаря информации, хранящейся в файлах cookie, ваши предпочтения запоминаются, когда вы возвращаетесь на сайт, и, таким образом, сайт лучше адаптируется под ваши потребности.</p>\n<p>Если вы предпочитаете отключать файлы cookies, вы можете сделать это, изменив настройки своего браузера. Однако это может помешать работе некоторых частей нашего сайта, поскольку они играют важную роль в предоставлении наших услуг.</p>\n<h2>Использование информации с сайта</h2>\n<p>Содержание этого сайта, может использоваться вами только в личных, информационных и/или некоммерческих целях и не может быть изменено вами каким-либо образом. За исключением случаев, явно указанных здесь, вы не можете использовать, загружать, публиковать, копировать, распечатывать, отображать, выполнять, воспроизводить, лицензировать, передавать или распространять любую информацию с этого веб-сайта полностью или частично без предварительного письменного согласия от Cadouri MD.</p>\n<h2>Согласие </h2>\n<p>Используя веб-сайт Cadouri MD, вы автоматически соглашаетесь на сбор и использование вашей личной информации, как описано в настоящей Политике конфиденциальности. Если мы изменим наши политики и процедуры конфиденциальности, мы опубликуем эти изменения на нашем веб-сайте, чтобы вы знали о том, какую информацию мы собираем, как мы ее используем и при каких обстоятельствах мы можем раскрыть ее. Если вы не согласны с этими изменениями, единственным средством защиты является прекращение использования веб-сайта.</p>','politika-konfidencialnosti');
