INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`)
VALUES
	(20,1,1,'','<p>A bouquet of 101 red roses will become a luxurious gift for any woman! Elegant solution for any holiday or just as a sign of youre love and passion!</p>','red-roses','Order 101 red roses online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau ➨ View more!','','Buy 101 red roses with delivery Chisinau, Moldova','101 Red Roses','','','',''),
	(20,1,2,'','<p>Un buchet din 101 de trandafiri roșii va deveni un cadou de lux pentru orice femeie! Un cadou elegant perfect pentru orice ocazie, un semn frumos de dragoste și pasiune!</p>','trandafir-rosu','Comandă 101 de trandafiri online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ Vezi pe site!','','Cumpără 101 trandafiri roșii cu livrare în Chișinău, Moldova','101 de Trandafiri Roșii','','','',''),
	(20,1,3,'','<p><span style=\"font-size:9pt;font-family:Arial;text-align:center;\">Букет из 101 красной розы станет роскошным подарком для любой женщины! Элегантное решение для любого женского праздника или просто так, как знак любви и страсти!</span></p>','krasnye-rozy','Купить 101 красную розу в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Купить 101 красную розу с доставкой Кишинев, Молдова','101 Красная Роза','','','',''),
	(20,1,4,'','','red-roses','','','','Red Roses','','','',''),
	(21,1,1,'','<p><span style=\"font-family:Arial;white-space:pre-wrap;\">51 white rose is a perfect way to show your afection to a lady. Beautiful and gentel bouquet is ment to surprise and will make her eyes shine! </span></p>','white-roses','Order 51 white roses online from the cadouri.md website ✓ We deliver everywhere across Moldova ✓ Personalized Bouquets ✓ Original Gifts ✓ Free delivery across Chisinau ➨ View more!','','Buy 51 white roses with delivery Chisinau, Moldova','51 White Roses','','','',''),
	(21,1,2,'','<p>51 - un număr frumos pentru a arăta sentimentele față de o femeie. Un astfel de cadou va surprinde plăcut orice domnișoară. Un buchet frumos și gingaș va face ochii iubitei să strălucească de fericire.</p>','trandafir-alb','Comandă 51 trandafiri albi online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ Vezi pe site!','','Cumpără 51 trandafiri albi cu livrare în Chișinău, Moldova','51 de Trandafiri Albi','','','',''),
	(21,1,3,'','<p>51 - прекрасное число для проявления своих чувств по отношению к даме. Такой знак внимания не оставит равнодушной ни одну девушку. Красивый нежный букет удивит и поселит блеск в прекрасных глазах женщины!</p>','belye-rozy','Купить 51 белую розу в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Купить 51 белую розу с доставкой Кишинев, Молдова','51 Белая Роза','','','',''),
