	(167,1,2,'','','poveti-de-ciocolata','Comandă cadou dulce de Anul Nou online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ Vezi pe site!','','Comandă Cadou Dulce de Anul Nou Chișinău Moldova','Povești de Ciocolată','','','',''),
	(167,1,3,'','<p>В детстве нам часто рассказывали сказки перед сном, некоторые из них обладаю особенной магией. Наша сказка про маленьких зайчат, которые очень любили Рождество и сладости! Создайте свою историю с чудесным гифт боксом! </p>\n<p>В состав входит:</p>\n<ul style=\"list-style-type:circle;\"><li>Рождественский леденец (как тот самый, который из кино)</li>\n<li>Мёд-суфле Sweet Honey (кунжутная медовая паста)</li>\n<li>Бельгийский лимонный шоколад, украшенный рисовыми хлопьями и фруктами манго</li>\n<li>Чёрный горький шоколад 70% с перцем чили, рисовыми хлопьями и шафраном</li>\n<li>Розовая, как заячьи лапки, плитка шоколада с малиной</li>\n<li>Семейка сладких зайчиков из молочного шоколада (советуем начинать есть с ушек)</li>\n<li>Новогодняя композиция из натуральных растений</li>\n</ul><p><strong>Наша компания не производит ничего съедобного. Мы забираем вкусняшки у наших партнёров в день заказа и посыпаем любовью.</strong></p>','shokoladnaya-skazka','Купить рождественский сладкий подарок и в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Заказать Рождественский сладкий подарок Кишинев Молдова','Шоколадная Сказка','','','',''),
