	(170,1,2,'','','cadoul-de-craciun','Comandă cadou de Crăciun cu miere și ciocolată online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ Vezi pe site!','','Comandă Cadou de Crăciun cu miere și ciocolată Chișinău Moldova','Cadoul de Crăciun','','','',''),
	(170,1,3,'','<p>Все обожают получать подарки, но нам кажется, что дарить их еще приятнее! В этом году мы подготовили для вас удивительные рождественские гифт-боксы - один сказочнее другого! </p>\n<p></p>\n<p>В состав гифт бокса входит:</p>\n<ul style=\"list-style-type:circle;\"><li>Мёд-суфле ручной работы с перетертым кунжутом</li>\n<li>Мёд-суфле ручной работы с малиной</li>\n<li>Шоколадные зайчата</li>\n<li>Рождественский леденец (как тот самый, из кино)</li>\n<li>Новогодняя композиция из натуральных растений</li>\n</ul><p><strong>Обратите внимание, что мы не производим ничего съедобного. Просто мы знаем, где взять самые красивые и вкусные сладости!</strong></p>','rozhdestvenskij-podarok','Купить новогодний подарок с медом и шоколадом в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Заказать Новогодний подарок с медом и шоколадом Кишинев Молдова','Рождественский Подарок','','','',''),
