INSERT INTO `ps_psblog_blog_lang` (`id_psblog_blog`, `id_lang`, `meta_description`, `meta_keywords`, `meta_title`, `link_rewrite`, `content`, `description`, `tags`)
VALUES
	(6,1,'How to choose a perfect gift for a Virgo? What flowers are suitable by Astrology? View more...','','Astrology Gift Giving: What to give to a Virgo?','astrology-gift-giving-what-to-give-to-a-virgo','<p></p>\n<p>Despite the fact that the name of this zodiac reminds us of femininity and sensitivity, Virgo women and girls are very intense and powerful personalities who know their goals and always reach them. Such people pass through life, overcoming all the difficulties. However, they are romantics and love occupies a dominant position in their lives.</p>\n<h2>What Flowers Do Virgo Prefer?</h2>\n<ul style=\"list-style-type:circle;\"><li>Virgo will appreciate your bouquet in any case. She also prefers wild flowers and classic roses. Exotic flowers does not scare them. The main idea is that the bouquet should create the right mood and match the occasion.</li>\n<li>If you want to surprise Virgo, you should pay attention to the following recommendations:</li>\n<li>Flowers must be fresh and have an elegant look. Virgo are attentive to the details. You should refuse to artificial decorations.</li>\n<li>Choose the flowers in a pasteled, gentle range. Give preference to a blue or pale pink, as well as avalanche color and other pastel colors.</li>\n<li>Virgo girls are very practical. Choosing flowers give your attention to simple and elegant flowers. For example, it might be a small mixed bouquet or flowers in the box. Too rich and complicated bouquets can cause associations with vulgarity. If you want to create a perfect bouquet for Virgo, perfect fit will be flowers, such as: garden rose, lilies, peonies, bat, carnations, alstroemeria, eustoma, chrysanthemums.</li>\n<li>Virgo girls also love the room plants, because the element of the Virgo sign is the earth. A green and blooming plant will become a perfect gift.</li>\n<li>If you bend what flowers will fit perfectly to make a beautiful present to the Virgin - use the \"Custom Bouquet Design\" option from our florist with the \"Bouquet for Virgo\" comment. All recommendations will be considered!</li>\n</ul><p>Be careful because Virgo considers a bouquet of flowers as a sign of attention, and not as a complete gift, therefore ...</p>\n<h2>What to give as a present to the Virgo?</h2>\n<p>A perfect gift for a Virgo will become something beautiful, for example:</p>\n<ul style=\"list-style-type:circle;\"><li>A book about self-development, inspiration and motivation</li>\n<li>An elegant and beautiful notepad or sketchbook</li>\n<li>A SPA gift set, decorated with flowers </li>\n</ul><p></p>','',''),
	(6,2,'Cum să alegi cadouri pentu Fecioara? Cum să alegi florile potrivite zodiei? Vezi mai mult...','','Flori și cadouri pentru Fecioare. Cum să alegi cadouri pentru cei născuți în Septembrie?','flori-i-cadouri-pentru-fecioare-cum-sa-alegi-cadouri-pentru-cei-nascui-in-septembrie','<p>În ciuda faptului că numele acestui zodiac ne reamintește despre feminitatea și sensibilitatea, femeile și fetele Fecioare sunt personalități foarte intense și puternice, care își cunosc obiectivele și care le vor atinge. Astfel de oameni trec cu îndrăzneală prin viață, depășind toate dificultățile. Cu toate acestea, sunt romantici și dragostea în viața lor ocupă o poziție dominantă.</p>\n<h2>Ce flori preferă Feciorele?</h2>\n<p>Fecioara va aprecia buchetul Dvs. în orice caz. Preferă și flori sălbatice și trandafiri clasici. Exotica, de asemenea, nu le sperie. Ideea principală este că buchetul trebuie să creeze dispoziția potrivită și să corespundă ocaziei.</p>\n<p>Dacă doriți să o surprindeți pe Fecioara, atrageți atenția la următoarele recomandări:</p>\n<ul style=\"list-style-type:circle;\"><li>Florile trebuie să fie proaspete și să aibă un aspect elegant. Fecioarele sunt atente la detalii. Ar trebui să refuzați la decor artificial.</li>\n<li>Alegeți florile într-o gamă pastelată, gingașă. Dați preferința unui albastru sau roz deschis, deasemenea se va potrivi culoarea avalanche și alte culori pastelate.</li>\n<li>Fetele Fecioare sunt foarte practice. Alegând florile acoradați atenția florilor simple și elegante. De exemplu, ar putea fi un mic buchet mixt sau flori într-o cutie pentru pălărie. Buchetele prea bogate și complicate pot provoca asociații cu vulgaritate. Pentru a crea un buchet perfect pentru Fecioare, se potrivesc florile, cum ar fi: trandafir de grădina, crini, bujori, liliac, garoafe, alstroemeria, eustoma, crizanteme.</li>\n<li>Fecioarele ador florile de cameră, deoarece elementul zodiei Fecioara este pământul. Fecioara va aminti cu plăcere și căldura sufletească despre un asemenea cadou. O plantă verde și înflorită va deveni un cadou perfect. </li>\n<li>Dacă vă îndoiți ce flori se vor potrivi perfect pentru a face un cadou frumos Fecioarei - utilizați funcția \"Buchetul Personalizat\" de la florarul nostru, cu comentariul \"Buchet pentru Fecioară\". Toate recomandările vor fi luate în considerare!</li>\n<li>Fiți atenți, deoarece Feciorele consideră ca un buchet de flori este doar un semn de atenție, și nu un cadou complet, deaceea...</li>\n</ul><h2>Ce să dăruiești Fecioarei?</h2>\n<p>Un cadou perfect pentru o Fecioră va deveni ceva frumosși uti, spre exemplu:</p>\n<ul style=\"list-style-type:circle;\"><li>O carte despre autodezvoltare, inspirație și motivație</li>\n<li>O agendă sau un caiet pentru notițe elegant și frumos</li>\n<li>Un set-cadou SPA, decorat cu flori </li>\n</ul>','',''),
	(6,3,'Как подобрать подарок девушке Деве? Как выбрать цветы, которые подходят по гороскопу? Подробнее...','','Какие цветы дарить Девам? Флористический прогноз.','kakie-cvety-darit-devam-floristicheskij-prognoz','<p>Несмотря на то, что название этого знака напоминает о женственности, нежности и и покорности, на самом деле женщины и девушки Девы - очень целеустремленные и сильные личности, знающие свои цели и идущие к их достижению. Такие люди четко знают, чего они хотят и как этого добиться, поэтому смело идут по жизни, преодолевая все трудности. Тем не менее они все еще романтичны и любовь в их жизни занимает главенствующее место. </p>\n<h2>Какие цветы подарить Девам? </h2>\n<ul style=\"list-style-type:circle;\"><li>Девы оценят Ваш букет в любом случае. Им придутся по душе и полевые цветы, и классические розы. Экзотика так же не напугает их. Главное, чтобы букет создавал правильное настроение и соответствовал поводу.</li>\n<li>Если вы хотите удивить Деву цветами, обратите внимание на следующие рекомендации:</li>\n<li>Цветы должны быть свежими и иметь опрятный вид. Девы всегда подмечают такие детали. Также стоит отказаться от искусственного декора.</li>\n<li>Отдайте предпочтение цветам в пастельной, нежной гамме цветов. Это может быть нежно розовый, нежно голубой, аваланж, кремовый и другие нежные цвета.</li>\n<li>Девушки Девы очень практичные. Выбирая цветы стоит обратить внимание на что-то простое и стильное. Например это может быть небольшой смешанный букет или цветы в шляпной коробке. Помпезные и сложные букеты могут вызвать у Девы ассоциации с грубостью и вульгарностью. Подойдут для создания идеального букета для Дев такие цветы, как: садовая роза, лилии, пионы, сирень, розовые гвоздики, альстрёмерии, эустомы, хризантемы.</li>\n<li>Девы просто обожают комнатные растения, ведь стихия Дев - Земля. Еще долго Дева будет с нежностью и теплотой в душе вспоминать ваш искренний жест, если вы подарите ей зеленое цветущее растение в горшке.</li>\n<li>Если вы сомневаетесь, какие цветы подойдут Деве и сделают ваш подарок неповторимым - воспользуйтесь функцией Авторский Букет от нашего флориста, с комментарием “Букет для Девы”. Тогда все рекомендации будут учтены!</li>\n</ul><p>Будьте осторожны, ведь Дева не рассматривает букет цветов как самостоятельный подарок, только как небольшой знак внимания, поэтому...</p>\n<h2>Что подарить Деве?</h2>\n<p>Идеальным подарком для Девы станет что-то красивое и практичное, например:</p>\n<ul style=\"list-style-type:circle;\"><li>Книга о саморазвитии, вдохновении и мотивации</li>\n<li>Элегантный ежедневник или блокнот для записей</li>\n<li>Подарочный SPA набор для ванны, оформленный цветами</li>\n<li>Сладкий медовый набор с орехами и сухофруктами для укрепления иммунитета</li>\n</ul><p></p>','<h2></h2>',''),
	(6,4,'','','Urna pretium elit mauris cursus Curabitur at elit Vestibulum','urna-pretium-elit-mauris-cursus-curabitur-at-elit-vestibulum','<p>Mi vitae magnis Fusce laoreet nibh felis porttitor laoreet Vestibulum faucibus. At Nulla id tincidunt ut sed semper vel Lorem condimentum ornare. Laoreet Vestibulum lacinia massa a commodo habitasse velit Vestibulum tincidunt In. Turpis at eleifend ps mi elit Aenean porta ac sed faucibus. Nunc urna Morbi fringilla vitae orci convallis condimentum auctor sit dui. Urna pretium elit mauris cursus Curabitur at elit Vestibulum. Mi vitae magnis Fusce laoreet nibh felis porttitor laoreet Vestibulum faucibus. At Nulla id tincidunt ut sed semper vel Lorem condimentum ornare. Laoreet Vestibulum lacinia massa a commodo habitasse velit Vestibulum tincidunt In. Turpis at eleifend ps mi elit Aenean porta ac sed faucibus. Nunc urna Morbi fringilla vitae orci convallis condimentum auctor sit dui. Urna pretium elit mauris cursus Curabitur at elit Vestibulum.</p>','<p>Mi vitae magnis Fusce laoreet nibh felis porttitor laoreet Vestibulum faucibus. At Nulla id tincidunt ut sed semper vel Lorem condimentum ornare.</p>','pstheme,prestashop,theme'),
	(7,1,'To make your fresh cut flowers last longer try follow our 5 simple lifehacks.',' fresh cut flowers,flowers stay long,take care of flowers,flowers in a bouquet ,bouquet','5 Lifehacks How To Make Your Fresh Cut Flowers Last Longer','5-lifehacks-how-to-make-your-fresh-cut-flowers-last-longer','<p>We all want the bouquet to stand as long as possible! Fresh flowers will delight you for a long time. We use the freshest flowers in our online store of gifts and flowers so that your bouquet will bring you pleasure as long as possible. Despite this, we want to offer you a few recommendations for the care, because even the freshest flowers can quickly wilt if they fall into the wrong conditions.</p>\n<p>1. Before placing flowers in water, remove all leaves and thorns from the stem to a level that will sink into the water. Then the flowers should be cut with a sharp knife or shears at a 45 degree angle.</p>\n<p>! It is necessary to cut the flowers every time, even if you just brought them from the store, or just change the water.</p>\n<p>2. Update the cut every day. Over time, the cut is tightened with a membrane, which prevents water absorption.</p>\n<p>3. Change the water every day. Pre-wash the vase, preferably with a sponge or brush, because on the walls of the vase can accumulate rot, that makes flowers wither faster.</p>\n<p>4. When you bring a bouquet at home, let them get used to the temperature and microclimate of the room. For example, if you brought flowers from the cold, leave them for 10-20 minutes on the balcony before unpacking and bringing into the room.</p>\n<p>5. Do not place a vase with flowers near heat sources or on direct sunlight.</p>\n<p>The Cadouri MD team wishes you the most beautiful bouquets!</p>','',''),
	(7,2,'Pentru ca florile în buchet să stea cât mai mult și să-și păstreze aspectul proaspăt, încercați recomandările noastre.','flori proaspete,cum să păstrezi flori,flori în buchet,flori tăiate,îngrijirea florilor','5 Lifehacks Despre Îngrijirea Florilor În Buchet','5-lifehacks-despre-ingrijirea-florilor-in-buchet','<p>Vrem cu toții ca buchetul cumpărat sau primit în dar de la un prieten apropiat să stea cât mai mult este posibil! Florile vă vor bucura mult timp dacă sunt proaspete. În magazinul nostru online de cadouri și flori Cadouri MD folosim doar cele mai proaspete flori. În acest articol vrem să vă oferim câteva recomandări pentru îngrijire a florilor, deoarece chiar și cele mai proaspete flori se pot ofeli repede, dacă se păstrează în condiții greșite.</p>\n<p>1. Înainte de a pune flori în apă, îndepărtați toate frunzele și spinii din tulpină până la nivelul care va fi scufundat în apă. Apoi florile trebuie să fie tăiate cu un cuțit ascuțit sau un pruner la un unghi de 45 de grade.</p>\n<p>! Tăiați flori de fiecare dată, chiar dacă tocmai le-ați adus din magazin sau pur și simplu schimbați apa.</p>\n<p>2. Reînnoiți tăitura în fiecare zi. Cu timpul, tăietura se va acoperi cu o peliculă, ceea ce va împiedica absorbției a apei.</p>\n<p>3. Trebuie să schimbați apa în fiecare zi. Vasul în care au stat florile trebuie să fie spălat cu o buretă, deoarece pe suprafața lui se acumulează putrezi (ceea ce face ca florile să olelească mai repede.)</p>\n<p>4. Când aduceți buchetul acasă, trebuie să se acomodeze cu temperatura și microclima camerei. Spre exemplu, dacă ați adus florile de la frig, lăsați buchetul să stea un timp în coridor sau la balcon, 10-20 de minute va fi de ajuns.</p>\n<p>5. Nu lăsați ca florile să stea lângă surse de căldură sau la razele directe a soarelui.</p>\n<p>Echipa site-ului Cadouri MD vă urează să primiți în dar doar cele mai frumoase buchete!</p>','','pstheme,prestashop,magento,opencart'),
	(7,3,'Чтобы цветы в букете, которые вы подарили, стояли долго, воспользуйтесь данными советами. Рекомендации по уходу, чтобы цветы долго радовали получателя.','цветы,цветы в срезке,рекомендации по уходу,как ухаживать за цветами,букет,как сохранить цветы,цветочный букет,свежие цветы','5 Лайфхаков по Уходу за Цветами','5-lajfkhakov-po-ukhodu-za-cvetami','<p>Всем нам хочется, чтобы купленный или подаренный близким человеком букет простоял как можно дольше! Цветы долго будут радовать вас, если окажутся свежими. В нашем интернет-магазине подарков и цветов мы используем только самые свежие цветы, чтобы ваш букет как можно дольше приносил вам удовольствие. Несмотря на это, мы хотим предложить вам несколько рекомендаций по уходу, ведь даже самые свежие цветы могут быстро завянуть, если попадут в неправильные условия.</p>\n<p>1. Перед тем, как поставить цветы в воду, следует удалить все листья и шипы со стебля до уровня, который будет погружаться в воду. Затем цветы нужно подрезать острым ножом или секатором под углом 45 градусов. </p>\n<p>! Подрезать цветы нужно обязательно каждый раз, даже если вы только принесли их из магазина, либо просто меняете воду. </p>\n<p>2. Обновлять срез нужно каждый день. Со временем срез затягивается пленкой, что препятствует поглощению воды.</p>\n<p>3. Менять воду следует каждый день. Вазу предварительно мыть, желательно с помощью губки или щетки, так как на стенках вазы может скапливаться гниль, от которой цветы вянут быстрее.</p>\n<p>4. Когда приносите букет или цветы домой, дайте им привыкнуть к температуре и микроклимату помещения. Например, если вы принесли цветы с холода, то оставьте их на 10-20 минут в коридоре или же на балконе и только после распаковывайте и вносите в комнату. </p>\n<p>5. Не ставьте вазу с цветами у источников тепла или под прямыми лучами солнца.</p>\n<p></p>\n<p>Команда сайта Cadouri MD желает вам самых красивых букетов!</p>\n<p></p>\n<p></p>','',''),
