	(9,1,'','','Профессия Флориста','professiya-florista','<p><strong>Кто-то с детства мечтает стать врачом, кто-то космонавтом, а как люди попадают во флористику?</strong></p>\n<p>Не знаю про всех людей, но я явно случайно. Иногда мне вспоминается история, как пару лет назад мне предлагали должность флориста, но я отказалась со словами: “Цветы - это не мое! Где я и где букеты. Составлять букеты...у меня для этого не хватит фантазии.” Но теперь я с уверенностью могу сказать, что да, моё!</p>\n<p><strong>Где у нас обучают этому мастерству?</strong></p>\n<p>Есть курсы, мастер классы, ворк шопы и индивидуальное обучение, но в наш век географических ограничений нет. Я подписана на курсы и онлайн школы в России, Украине, Лондоне, Германии и даже Нью-Йорке. На мой взгляд, у такого обучения есть несколько неоспоримых плюсов. Например, обучение не заканчивается никогда, ты всё время получаешь какую-то новую информацию, в любое время можешь ею воспользоваться, даже лежа на шезлонге где-нибудь на пляже)</p>\n<p><strong>Как ты придумываешь букеты?</strong></p>\n<p>Очень по-разному. Поток “придумывания” не останавливается. Сейчас я подписана на такое количество каналов, страниц и флористов во всевозможных сетях, что потеряла счет. Когда окружающие думают, что я просто “залипла” в инстаграме, то это не обязательно так. После такого просмотра у меня скапливается куча закладок и скриншотов. </p>\n<p>Еще бывает, что общаешься с человеком, и вдруг в голове рождается образ букета, который ты бы ему подарил. </p>\n<p>Но самое интересное бывает, когда мне это снится. Главное на утро ничего не забыть. </p>\n<p><strong>Как ты считаешь, любой человек может стать флористом?</strong></p>\n<p>Каждый человек может стать продавцом цветов, но будет ли этот каждый хорошим флористом? Для меня флористика нечто более тонкое. Цветы, это в первую очередь жест любви, нежности и тепла. Флористу нужно любить свое дело, чтобы его работа доставляла кому-то счастье.  </p>\n<p><strong>Кажется, что это так здорово работать с цветами! А есть ли минусы у этой профессии?</strong></p>\n<p>Да, это важный вопрос. Во-первых это физически сложная работа. Ты работаешь руками и на ногах. Во-вторых, это достаточно грязная работа ( маникюр для меня долгое время была больная тема))) Ну, и не стоит забывать, что у флориста нет выходных, нет праздников, особенно 8 марта. А ещё, нам не дарят цветы. Все почему-то решили, что нам цветы и на работе надоедают. Это не так! Дарите флористам цветы!</p>\n<p><strong>Какие цели ты ставишь себе на ближайшие 5 лет?</strong></p>\n<p>Мечтаю пройти несколько очных курсов у моих вдохновителей, за которыми слежу онлайн. В планах еще студия и школа. Они уже имеют свой вид до мельчайших деталей у меня в голове. А также, очень хочется сократить путь цветов от голландской грядки до нашего холодильника на несколько шажков.</p>\n<p></p>','','opencart,theme'),
